(44, 1, '<b>Los propietarios de la libertad</b><br>\nLas palabras cumplen ciclos; las actitudes también. Sin\nembargo, cuando las palabras designan actitudes, los ciclos\nse vuelven más complejos. Cuando el hoy tan denostado\nSartre puso la palabra compromiso sobre el tapete y\nhasta Mac Leish publicó un libro sobre la responsabilidad\nde los intelectuales, estas dos palabras, compromiso y\nresponsabilidad, designaban actitudes que, sin ser gemelas,\neran bastante afines. Salvo contadas excepciones, los\nintelectuales de entonces las hicieron suyas y, equivocados\no no, dijeron sin eufemismos por qué empeño se la jugaban.\nLos intelectuales latinoamericanos también\ncomprendieron dónde estaba esta vez el enemigo. Sólo\nentonces empezó la mala prensa. Los grandes pontífices\nde la propaganda subrayaron una y otra vez la palabra\nlibertad y denostaron el compromiso. Libertad no era\nlibrarse de Batista o de Somoza, sino mantener la prensa\nlibre. Libertad es la emocionada comprobación de que la\ngran prensa norteamericana es capaz de descubrir que\nLumumba o Allende fueron liquidados por la CIA, sin\nponer el acento en que eso no sirve para resucitarlos.\n¿Y compromiso? Es la actitud que adoptan\nciertos intelectuales, cuya carga ideológica perjudica\nnotoriamente su arte. Después de todo, ¿cómo se atreven\na frecuentar las provincias del espíritu, si es público y\nnotorio que tales ámbitos son patrimonio exclusivo de los\npropietarios de la libertad?<br> Transformar palavras em atitudes tem sido um dos\ngrandes dilemas dos intelectuais. Ao ponderar sobre\nessa temática, o autor, um dos grandes críticos e literatos\nlatino-americanos da atualidade, leva o leitor a perceber\nque:  ', '', 'Intermediária', 'o compromisso político afasta o artista da criação.', 'os costumes sociais governam a linguagem e as atitudes das pessoas.', 'o compromisso ideológico de alguns intelectuais está refletido em suas obras.', 'a complexidade relacionada ao conceito de liberdade impede o compromisso.', 'os intelectuais latino-americanos têm um posicionamento acrítico perante o poder.', 'c', 'Os filósofos colocam importância de que as obras tem relação com o momento vivido. Isso relacionadao com as palavras COMPROMISO e RESPONSABILIDAD citadas nas linhas 6 e 7, Essas palavras defendidas também nas linhas 8 e 9: \"salvo contadas excepciones... las hicieron suyas\".', '', 'Espanhol', 3),
(45, 2, '<b>Pablo Pueblo</b><br>\r\nRegresa un hombre en silencio<br>\r\nDe su trabajo cansado<br>\r\nSu paso no lleva prisa<br>\r\nSu sombra nunca lo alcanza<br><br>\r\nLo espera el barrio de siempre<br>\r\nCon el farol en la esquina<br>\r\nCon la basura allá en frente<br>\r\nY el ruido de la cantina<br><br>\r\nPablo Pueblo<br>\r\nllega hasta el zaguán oscuro<br>\r\nY vuelve a ver las paredes<br>\r\nCon las viejas papeletas<br>\r\nQue prometían futuros<br>\r\nen lides politiqueras<br>\r\nY en su cara se dibuja<br>\r\nla decepción de la espera.<br><br>\r\nRubén Blades é um compositor panamenho de canções\r\nsocialmente engajadas. O título Pablo Pueblo, associado ao\r\nconteúdo da letra da canção, revela uma crítica social ao:', '', 'Intermediária', 'contrapor a individualidade de um sujeito a uma estrutura social marcada pela decepção na atuação política.', 'demonstrar que o problema sofrido pelo indivíduo atinge toda a comunidade.', 'relativizar a importância que se dá ao sofrimento individual em uma estrutura social baseada na exploração.', 'descrever a vida de um sujeito que nunca resolve suas inquietações e, por isso, mantém-se silencioso.', 'usar um apelido jocoso para designar a atuação de um indivíduo em seu próprio bairro.', 'a', 'Resolução justificada na segunda estrofe: \"Lo espera el barrio de siempre Con el farol en la esquina Con la basura allá en frente Y el ruido de la cantina\". Também na terceira estrofe: \"lega hasta el zaguán oscuro Y vuelve a ver las paredes Con las viejas papeletas Que prometian futuros en lides politiqueras\"', '', 'Espanhol', 3),
(46, 3, '<p>Poco después apareció en casa de Elisenda Morales,\r\narrastrando su cansancio y las contrariedades de un largo\r\ndía que había dejado su ánimo en ruinas. A pesar de\r\ntodo, supo resistirlo, y cuando ella le ofreció una copa de\r\nmistela, abandonó su asiento para ir hasta la tienda en\r\nbusca de algo más estimulante.</p>\r\n<p>Allí, en el corredor de la casa, en taburetes separados,\r\nrecibieron los primeros cálidos soplos de la noche. Con su\r\nhabitual entereza, Elisenda entró a conectar la luz de la\r\nsala, sofocando parte de su reflejo, mientras comentaba\r\nque así estarían mejor. Al menos, pensó el tío Camarillo,\r\nno había sacado la lámpara como otras veces, ni le había\r\nentregado alguno de sus álbumes, y parecía en cambio\r\ndecidida a mantener en ascuas al vecindario. Aquélla fue\r\nla primera vez que en mucho tiempo dejaron de lado el\r\ntema de las rentas, para entrar con pies de plomo en el\r\nespinoso terreno de las confidencias.</p>\r\n\r\n<small>SÁNCHEZ, H. El héroe de la família. Bogotá: Tercer Mundo, 1988.</small>\r\n\r\nNo texto, no qual é narrada a visita à casa de uma\r\npersonagem, a expressão “entrar con pies de plomo” é\r\nutilizada para se referir ao(à):', '', 'Intermediária', 'determinação para conduzir discussões pessoais.', 'insensibilidade para lidar com temas do passado', 'discrição para administrar questões financeiras', ' disposição para resolver problemas familiares.', 'cuidado para tratar de assuntos íntimos.', 'e', 'Resolução justificada na segunda estrofe: \"Lo espera el barrio de siempre Con el farol en la esquina Con la basura allá en frente Y el ruido de la cantina\" Também na terceira estrofe: \"lega hasta el zaguán oscuro Y vuelve a ver las paredes Con las viejas papeletas Que prometian futuros en lides politiqueras\"', '', 'Espanhol', 3),
(47, 4, '<b>Oye, Pito, ésta es: la vida bruta de un boy</b><br>\r\nmis tierras eran<br>\r\nnuevo méxico, colorado,<br>\r\ncalifornia, arizona, tejas,<br>\r\ny muchos otros senderos,<br>\r\naún cuando la luz existía\r\nsonrientemente<br>\r\nen las palabras<br>\r\nde mis antepasados...<br>\r\nera entonces hombre,<br>\r\nmaduro y sencillo<br>\r\ncomo los cerros y los peñascos,<br>\r\ny mi cultura era el atole,<br>\r\nel chaquehue, y los buenos días;<br>\r\nmi idioma cantaba<br>\r\nversículos<br>\r\npor los cañones<br>\r\nde tierra roja<br>\r\ny tierra amarilla...<br>\r\nHoy sí, hoy ya no soy<br>\r\nmejicano ni hispano<br>\r\nni tampoco americano,<br>\r\npero soy — y bien lo siento ser —<br>\r\nuna sombra del pasado<br>\r\ny un esfuerzo<br>\r\nhacia el futuro...<br>\r\n\r\n<small>SÁNCHEZ, R. Disponível em: www.materialdelectura.unam.mx. Acesso em: 4 dez. 2017</small>\r\nAo abordar a expropriação de territórios mexicanos pelos\r\nEstados Unidos, o eu lírico do poema revela um(a):', '', 'Intermediária', 'rejeição da língua utilizada por seus antepassados.', 'desejo de pertencimento ao espaço estadunidense', 'certeza de manutenção de suas tradições.', ' reivindicação de um mundo unificado.', 'sentimento de conflito de identidades.', 'e', 'O eu lírico revela a esperança de uma identidade nova, tendo em consideração as referências de antepassados para criar seu futuro: seus \"hoy ya no soy mejicano ni hispano... hacia el futuro.\"', '', 'Espanhol', 3),
(48, 5, '<b>La violencia como bella arte</b><p>Pues bien, ‘Relatos Salvajes’, de Damián Szifrón,\r\nes sobre todo un brillante esfuerzo por poner rostro, por\r\nfotografiar, a la parte de la violencia que tanto cuesta\r\nver en el cine. De repente, el director argentino coloca\r\nal espectador ante el espectáculo, digamos putrefacto,\r\nde una sociedad enferma de su propia indolencia,\r\nanestesiada por su ira, incapaz de entender el origen\r\nde la insatisfacción que la habita. ¿Cómo se quedan?\r\nSí, estamos delante de la una película vocacionalmente\r\nviolenta, obligadamente salvaje, pero, y sobre todo,\r\ndeslumbrante en su claridad.</p> <p>Más allá del esplendor sabio de una producción\r\nperfecta, lo que más duele, lo que más divierte, lo que\r\nmás conmueve es la sensación de reconocimiento. Cada\r\nuno de los damnificados, pese a su acento marcadamente\r\nargentino, somos nosotros. O, mejor, cada insulto\r\nproferido, y no siempre entendido, es nuestro, en algún\r\nmomento ha salido de nuestra boca. O saldrá.</p> <p>La violencia no es sólo eso que tanto desagrada a\r\nlos profesionales del buen gusto, a los programadores de\r\nópera o a los filósofos de la nada; la violencia, la realmente\r\ninsoportable, es también una cuestión de actitud, un\r\nsimple gesto. Y esa violencia está por todas partes, está\r\ndentro. Y Szifrón acierta a retratarla tan fielmente que no\r\nqueda otra cosa que romper a reír. Aunque sólo sea de\r\nsimple desesperación. Brillante, magistral incluso.</p>\r\n<small>MARTÍNEZ, L. Disponível em: www.elmundo.es. Acesso em: 13 abr. 2015 (adaptado)</small>\r\n\r\nNessa resenha crítica acerca do filme Relatos Salvajes,\r\no autor evidencia o:', '', 'Intermediária', 'cômico como fuga da sociedade diante de situações violentas.', ' estado de apatia da sociedade perante a violência rotineira do mundo atual.', 'empecilho para o espectador vivenciar a violência bruta na realidade e na ficção.', 'sotaque reforçado dos personagens a fim de marcar o espaço do cinema argentino. ', 'autorreconhecimento diante dos diversos tipos de comportamento humano frente à violência.', 'e', 'De repente, el director argentino coloca la espectador ante el espectáculo, digamos putrefacto, de una sociedad enferma de su propia indolencia, anestesiada por su ira, incapaz de entender el origen de la insatisfacción que la habita.\"', '', 'Espanhol', 3),
(49, 1, 'Finally, Aisha finished with her customer and asked\r\nwhat colour Ifemelu wanted for her hair attachments.<br>\r\n“Colour four.”<br>\r\n“Not good colour,” Aisha said promptly.<br>\r\n“That’s what I use.”<br>\r\n“It look dirty. You don’t want colour one?”<br>\r\n“Colour one is too black, it looks fake,” Ifemelu said,\r\nloosening her headwrap. “Sometimes I use colour two,\r\nbut colour four is closest to my natural colour.”<br>\r\n[...]<br>\r\nShe touched Ifemelu’s hair. “Why you don’t have\r\nrelaxer?”<br>\r\n“I like my hair the way God made it.”<br>\r\n“But how you comb it? Hard to comb,” Aisha said.<br>\r\nIfemelu had brought her own comb. She gently combed\r\nher hair, dense, soft and tightly coiled, until it framed her\r\nhead like a halo. “It’s not hard to comb if you moisturize\r\nit properly,” she said, slipping into the coaxing tone of the\r\nproselytizer that she used whenever she was trying to\r\nconvince other black women about the merits of wearing\r\ntheir hair natural. Aisha snorted; she clearly could not\r\nunderstand why anybody would choose to suffer through\r\ncombing natural hair, instead of simply relaxing it. She\r\nsectioned out Ifemelu’s hair, plucked a little attachment\r\nfrom the pile on the table and began deftly to twist.<br>\r\n\r\n<small>ADICHIE, C. Americanah: A novel. New York: Anchor Books, 2013.</small><br>\r\n\r\nA passagem do romance da escritora nigeriana traz\r\num diálogo entre duas mulheres negras: a cabeleireira,\r\nAisha, e a cliente, Ifemelu. O posicionamento da cliente é\r\nsustentado por argumentos que:', '', 'Intermediária', 'reforçam um padrão de beleza.', 'retratam um conflito de gerações.', 'revelam uma atitude de resistência.', 'demonstram uma postura de imaturidade.', 'evidenciam uma mudança de comportamento.', 'c', 'Percebe-se essa resistência nos trechos \"I like my hair the way God made it.\" e \"...slipping into the coaxing tone of thetizer that she used whenever she was trying to convince other black women about the merits of wearing their hair natural.\" \"coaxing tone = tom persuasivo \"proselytizer = convencimento', '', 'Inglês', 3),
(50, 2, '<b>A Minor Bird</b><br>\r\nI have wished a bird would fly away,<br>\r\nAnd not sing by my house all day;<br>\r\nHave clapped my hands at him from the door<br>\r\nWhen it seemed as if I could bear no more.<br>\r\nThe fault must partly have been in me.<br>\r\nThe bird was not to blame for his key.<br>\r\nAnd of course there must be something wrong<br>\r\nIn wanting to silence any song.<br>\r\n<small>FROST, R. West-running Brook. New York: Henry Holt and Company, 1928</small><br>No poema de Robert Frost, as palavras “fault” e “blame”\r\nrevelam por parte do eu lírico uma:', '', 'Intermediária', ' culpa por não poder cuidar do pássaro. ', 'atitude errada por querer matar o pássaro. ', 'necessidade de entender o silêncio do pássaro', 'sensibilização com relação à natureza do pássaro. ', 'irritação quanto à persistência do canto do pássaro.', 'd', 'Lê-se no texto: The fault must partly have been in me. The bird was not to blame for his key.\" \" A culpa deve ser parcialmente minha, o passaro não deveria ser culpado por seu canto.', '', 'Inglês', 3),
(51, 3, '<b>A Mother in a Refugee Camp</b><br>\r\nNo Madonna and Child could touch<br>\r\nHer tenderness for a son<br>\r\nShe soon would have to forget...<br>\r\nThe air was heavy with odors of diarrhea,<br>\r\nOf unwashed children with washed-out ribs<br>\r\nAnd dried-up bottoms waddling in labored steps<br>\r\nBehind blown-empty bellies. Other mothers there<br>\r\nHad long ceased to care, but not this one:<br>\r\nShe held a ghost-smile between her teeth,<br>\r\nand in her eyes the memory<br>\r\nOf a mother’s pride... She had bathed him<br>\r\nAnd rubbed him down with bare palms.<br>\r\nShe took from their bundle of possessions<br>\r\nA broken comb and combed<br>\r\nThe rust-colored hair left on his skull<br>\r\nAnd then — humming in her eyes — began carefully<br>\r\n [to part it.<br>\r\nIn their former life this was perhaps<br>\r\nA little daily act of no consequence<br>\r\nBefore his breakfast and school; now she did it<br>\r\nLike putting flowers on a tiny grave.<br>\r\n\r\n<small>ACHEBE, C. Collected Poems. New York: Anchor Books, 2004</small><br>O escritor nigeriano Chinua Achebe traz uma reflexão\r\nsobre a situação dos refugiados em um cenário pós-guerra\r\ncivil em seu país. Essa reflexão é construída no poema\r\npor meio da representação de uma mãe, explorando a(s): ', '', 'Intermediária', 'demonstração de orgulho por não precisar pedir doações.', 'descrições artísticas detalhadas de uma obra conhecida.', 'aceitação de um diagnóstico de doença terminal do filho', 'consternação ao visitar o túmulo do filho recém-falecido.', 'impressões sensoriais experimentadas no ambiente.', 'e', 'A situação dos refugiados é construida a partir de sensoriais presentes nos versos do poema, tais como: \"The air was heavy with odors of diarrhea. Behind blown-empty bellies... The rust-colored hair ieft on his skull\"', '', 'Inglês', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(52, 4, 'Nesse pôster de divulgação de uma campanha que\r\naborda a diversidade e a inclusão, a interação dos\r\nelementos verbais e não verbais faz referência ao ato de:\r\n', , 'Fácil', 'estereotipar povos de certas culturas', 'discriminar hábitos de grupos minoritários', 'banir imigrantes de determinadas origens.', 'julgar padrões de beleza de diversas etnias.', 'desvalorizar costumes de algumas sociedades.', 'a', 'Lê-se no pôster: \"This is not who we are, and this is not ok\" que é traduzido como: \"Isso não é o que somos e isso não está certo\".', '', 'Inglês', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(53, 5, 'Os recursos usados nesse pôster de divulgação de uma\r\ncampanha levam o leitor a refletir sobre a necessidade de:', , 'Fácil', 'criticar o tipo de tratamento dado à mulher', 'rever o desempenho da mulher no trabalho.', 'questionar a sobrecarga de atribuições da mulher.', 'analisar as pesquisas acerca dos direitos da mulher.', 'censurar a mulher pelo uso de determinadas palavras', 'a', 'Lê-se no pôster: \"Women shouldn\'t suffer from discrimination anymore\" As mulheres não deveriam mais sofrer discriminação.', '', 'Inglês', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(54, 6, 'Essa campanha de conscientização sobre o assédio\r\nsofrido pelas mulheres nas ruas constrói-se pela\r\ncombinação da linguagem verbal e não verbal. A imagem\r\nda mulher com o nariz e a boca cobertos por um lenço é\r\na representação não verbal do(a):', 0x696d6167656d5f323032332d31312d32305f3032333333393937312e706e67, 'Intermediária', 'silêncio imposto às mulheres, que não podem denunciar o assédio sofrido.', 'metáfora de que as mulheres precisam defender-se do assédio masculino.', ' constrangimento pelo qual passam as mulheres e sua tentativa de esconderem-se.', 'necessidade que as mulheres têm de passarem despercebidas para evitar o assédio', ' incapacidade de as mulheres protegerem-se da agressão verbal dos assediadores.', 'b', 'A questão apresenta uma campanha de conscientização em que, de forma metafórica, a rua é apresentada como um campo de batalha para mulher, tendo em vista ser um espaço onde ela sofre assédio e que, por isso, exige dela uma postura combativa. Assim, na imagem, ao colocar o lenço, a mulher está se preparando para defender-se dos assédios masculinos que podem vir a ocorrer.', '', 'Linguagens', 3),
(55, 7, '<b>Mulher tem coração clinicamente partido após morte\r\nde cachorro</b> <p>Como explica o The New England Journal of\r\nMedicine, a paciente, chamada Joanie Simpson, tinha\r\nsinais de infarto, como dores no peito e pressão alta,\r\ne apresentava problemas nas artérias coronárias. Ao\r\nfazerem um ecocardiograma, os médicos encontraram o\r\nproblema: cardiomiopatia de Takotsubo, conhecida como\r\nsíndrome do coração partido.</p> <p>Essa condição médica tipicamente acontece com\r\nmulheres em fase pós-menstrual e pode ser precedida\r\npor um evento muito estressante ou emotivo. Nesses\r\ncasos, o coração apresenta um movimento discinético\r\ntransitório da parede anterior do ventrículo esquerdo, com\r\nacentuação da cinética da base ventricular, de acordo\r\ncom um artigo médico brasileiro que relata um casosemelhante. Simpson foi encaminhada para casa após\r\ndois dias e passou a tomar medicamentos regulares.</p> <p>Ao Washington Post, ela contou que estava quase\r\ninconsolável após a perda do seu animal de estimação,\r\num cão da raça yorkshire terrier. Recuperada após cerca\r\nde um ano, ela diz que não abrirá mão de ter um animal\r\nde estimação porque aprecia a companhia e o amor que\r\nos cachorros dão aos humanos. O caso aconteceu em\r\nHouston, nos Estados Unidos. </p> <small>Disponível em: https://exame.abril.com.br. Acesso em: 1 dez. 2017.</small><p>Pelas características do texto lido, que trata das\r\nconsequências da perda de um animal de estimação,\r\nconsidera-se que ele se enquadra no gênero</p>', 0x696d6167656d5f323032332d31312d32305f3032333333393937312e706e67, 'Intermediária', 'conto, pois exibe a história de vida de Joanie Simpson.', 'depoimento, pois expõe o sofrimento da dona do ', 'reportagem, pois discute cientificamente a cardiomiopatia.', 'relato, pois narra um fato estressante vivido pela paciente', 'notícia, pois divulga fatos sobre a síndrome do coração partido.', 'e', 'O texto lido, publicado em meio jornalistico (revista Exame), expõe o caso de uma mulher que teve \"sinais de infarto, como dores no peito e pressão alta, e apresentava problemas nas artérias coronárias.\". A partir disso, aproveita-se para divulgar fatos sobre a chamada \"sindrome do coração partido\", o diagnóstico no qual ela se enquadrava.', '', 'Linguagens', 3),
(56, 8, '<p>Chiquito tinha quase trinta quando conheceu Mariana\r\nnum baile de casamento na Forquilha, onde moravam\r\nuns parentes dele. Por lá foi ficando, remanchando. Fez\r\nmal à moça, como costumavam dizer, tiveram de casar às\r\npressas. Morou uns tempos com o sogro, descombinaram.\r\nFoi só conta de colher o milho e vender. Mudou pra casa\r\ndo velho Chico Lourenço [seu pai]. Fumaça própria só viu\r\nsubir um par de anos depois, quando o pai repartiu as\r\nterras. De tão parecidos, pai e filho nunca combinaram\r\ndireito. Cada qual mais topetudo, muitas vezes dona\r\nAparecida ouvia o marido reclamar da natureza forte do\r\nfilho. Ela escutava com paciência e respondia dum jeito\r\nsempre igual:</p> <br>— “Quem herda, não rouba”.\r\nVinha um brilho nos olhos, o velho se acalmava <br> <small>ROMANO, O. Casos de Minas. Rio de Janeiro: Paz e Terra, 1982</small>\r\n<p>Os ditados populares são frases de sabedoria criadas\r\npelo povo, utilizadas em várias situações da vida. Nesse\r\ntexto, a personagem emprega um ditado popular com a\r\nintenção de:</p>', '', 'Intermediária', 'criticar a natureza forte do filho.', 'justificar o gênio difícil de Chiquito.', 'legitimar o direito do filho à herança.', 'conter o ânimo violento de Chico Lourenço.', 'condenar a agressividade do marido contra o filho.', 'b', 'O pai, ao reclamar da personalidade do filho, recebe da esposa como resposta o ditado popular \"Quem herda, não rouba\": a justificativa para \"natureza forte\" do filho é o fato de ele ter herdado do pai tal comportamento.', '', 'Linguagens', 3),
(57, 9, '<p>Eu tenho empresas e sou digno do visto para ir a\r\nNova York. O dinheiro que chove em Nova York é para\r\npessoas com poder de compra. Pessoas que tenham\r\num visto do consulado americano. O dinheiro que chove\r\nem Nova York também é para os nova-iorquinos. São\r\nmilhares de dólares. [...] Estou indo para Nova York, onde\r\nestá chovendo dinheiro. Sou um grande administrador.\r\nSim, está chovendo dinheiro em Nova York. Deu no rádio.\r\nVejo que há pedestres invadindo a via onde trafega o\r\nmeu carro vermelho, importado da Alemanha. Vejo que\r\nhá carros nacionais trafegando pela via onde trafega o\r\nmeu carro vermelho, importado da Alemanha. Ao chegar\r\nem Nova York, tomarei providências.</p> <small>SANT’ANNA, A. O importado vermelho de Noé. In: MORICONI, I. (Org.).\r\nOs cem melhores contos. Rio de Janeiro: Objetiva, 2001.</small> <p>As repetições e as frases curtas constituem procedimentos\r\nlinguísticos importantes para a compreensão da temática\r\ndo texto, pois:</p>', '', 'Intermediária', 'expressam a futilidade do discurso de poder e de distinção do narrador.', ' disfarçam a falta de densidade das angústias existenciais narradas.', 'ironizam a valorização da cultura norte-americana pelos brasileiros.', 'explicitam a ganância financeira do capitalismo contemporâneo.', 'criticam os estereótipos sociais das visões de mundo elitistas.', 'a', 'O texto expõe a futilidade de seu narrador que se entende como alguém superior por conta de seu poder aquisitivo. Essa futilidade fica nítida pela repetição de frases parecidas e curtas que não possuem qualquer criticidade para serem mais elaboradas.', '', 'Linguagens', 3),
(58, 9, '<p>Eu tenho empresas e sou digno do visto para ir a\r\nNova York. O dinheiro que chove em Nova York é para\r\npessoas com poder de compra. Pessoas que tenham\r\num visto do consulado americano. O dinheiro que chove\r\nem Nova York também é para os nova-iorquinos. São\r\nmilhares de dólares. [...] Estou indo para Nova York, onde\r\nestá chovendo dinheiro. Sou um grande administrador.\r\nSim, está chovendo dinheiro em Nova York. Deu no rádio.\r\nVejo que há pedestres invadindo a via onde trafega o\r\nmeu carro vermelho, importado da Alemanha. Vejo que\r\nhá carros nacionais trafegando pela via onde trafega o\r\nmeu carro vermelho, importado da Alemanha. Ao chegar\r\nem Nova York, tomarei providências.</p> <small>SANT’ANNA, A. O importado vermelho de Noé. In: MORICONI, I. (Org.).\r\nOs cem melhores contos. Rio de Janeiro: Objetiva, 2001.</small> <p>As repetições e as frases curtas constituem procedimentos\r\nlinguísticos importantes para a compreensão da temática\r\ndo texto, pois:</p>', '', 'Intermediária', 'expressam a futilidade do discurso de poder e de distinção do narrador.', ' disfarçam a falta de densidade das angústias existenciais narradas.', 'ironizam a valorização da cultura norte-americana pelos brasileiros.', 'explicitam a ganância financeira do capitalismo contemporâneo.', 'criticam os estereótipos sociais das visões de mundo elitistas.', 'a', 'O texto expõe a futilidade de seu narrador que se entende como alguém superior por conta de seu poder aquisitivo. Essa futilidade fica nítida pela repetição de frases parecidas e curtas que não possuem qualquer criticidade para serem mais elaboradas.', '', 'Linguagens', 3),
(59, 10, '<b>DECRETO N. 28 314, DE 28 DE SETEMBRO DE 2007</b>\r\n<br>Demite o Gerúndio do Distrito Federal e dá outras providências<br> \r\nO GOVERNADOR DO DISTRITO FEDERAL, no uso\r\ndas atribuições que lhe confere o artigo 100, incisos VII\r\ne XXVI, da Lei Orgânica do Distrito Federal, DECRETA:<br> Art. 1° Fica demitido o Gerúndio de todos os órgãos do\r\nGoverno do Distrito Federal.<br>Art. 2° Fica proibido, a partir desta data, o uso do gerúndio\r\npara desculpa de INEFICIÊNCIA.<br>Art. 3° Este Decreto entra em vigor na data de sua\r\npublicação. <br>Art. 4º Revogam-se as disposições em contrário <br>Brasília, 28 de setembro de 2007. 119º da República e 48º de Brasília<br><small>Disponível em: www.dodf.gov.br. Acesso em: 11 dez. 2017</small><p>Esse decreto pauta-se na ideia de que o uso do gerúndio,\r\ncomo “desculpa de ineficiência”, indica:</p>\r\n', '', 'Intermediária', 'conclusão de uma ação.', 'realização de um evento.', 'repetição de uma prática.', 'continuidade de um processo.', 'transferência de responsabilidade.', 'd', 'O gerúndio é usado para indicar ações continuas, em andamento. O uso dessa forma nominal pode ser entendido como \"desculpa de ineficiência\" por indicar prolongamento de uma ação, falta de conclusão de um determinado processo.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(60, 11, 'A obra de Joseph Kosuth data de 1965 e se constitui por\r\numa fotografia de cadeira, uma cadeira exposta e um\r\nquadro com o verbete “Cadeira”. Trata-se de um exemplo\r\nde arte conceitual que revela o paradoxo entre verdade e\r\nimitação, já que a arte', , 'Intermediária', 'não é a realidade, mas uma representação dela.', 'fundamenta-se na repetição, construindo variações.', 'não se define, pois depende da interpretação do fruidor.', 'resiste ao tempo, beneficiada por múltiplas formas de registro.', 'redesenha a verdade, aproximando-se das definições lexicais.', 'a', 'A obra \"One and Three Chairs\", de Joseph Kosuth, composta por uma fotografia de cadeira, por uma cadeira e por um verbete de dicionário, que conceitua \"cadeira\", propõe uma reflexão sobre a essência da arte. Essa visão crítica expõe que o objeto artístico não é a realidade, mas sim uma representação dela.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(61, 12, 'A realidade virtual é uma tecnologia de informação que, conforme sugere a imagem, tem como uma de suas principais funções', , 'Intermediária', 'promover a manipulação eficiente de conhecimentos e informações de difícil compreensão no mundo físico.', 'conduzir escolhas profissionais da área de ciência da computação, oferecendo um leque de opções de atuação.', 'transferir conhecimento da inteligência artificial para as áreas tradicionais, como as das ciências exatas e naturais.', ' levar o ser humano a experimentar mentalmente outras realidades, para as quais é transportado sem sair de seu próprio lugar.', 'delimitar tecnologias exclusivas de jogos virtuais, a fim de oferecer maior emoção ao jogador por meio de outras realidades.', 'd', 'A imagem sugere que a realidade virtual é capaz de oferecer ao usuário experiências mentais infinitas sem sair do lugar. Essa tecnologia transporta o indivíduo, que pode interagir ou não, com a situação representada em um ambiente virtual.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(62, 13, '<b>TEXTO I <br> Poesia em cartaz</b> <p>O caminho habitual para o trabalho, aquele em que\r\na gente já nem repara direito, pode ficar mais belo com\r\num poema. O projeto #UmLambePorDia nasceu desta\r\nintenção: trazer mais cor e alegria para a cidade por meio\r\nde cartazes coloridos ao estilo lambe-lambe. Quem teve\r\na ideia foi o escritor Leonardo Beltrão, em Belo Horizonte.\r\n“Em meio a olhares cada vez mais viciados, acabamos\r\nnos esquecendo da beleza envolvida em cada esquina\r\ne no próprio poder transformador da palavra”. Assim, a\r\ncada dia um cartaz é colocado por aí, para nos lembrar de\r\nreparar na cidade, na vida que corre ao redor e também\r\nem nós mesmos. </p> <p>Considerando-se a função que os cartazes colados em\r\npostes normalmente exercem nas ruas das cidades\r\ngrandes, esse texto evidencia a:</p>', , 'Intermediária', 'disseminação da arte poética em um veículo não convencional. ', ' manutenção da expectativa das pessoas ao andarem pelas ruas.', ' necessidade de exposição de poemas pequenos em diferentes suportes.', ' característica corriqueira do suporte lambe-lambe, muito comum nas ruas.', 'exposição da beleza escondida das esquinas da cidade de Belo Horizonte.', 'a', 'A imagem sugere que a realidade virtual é capaz de oferecer ao usuário experiências mentais infinitas sem sair do lugar. Essa tecnologia transporta o indivíduo, que pode interagir ou não, com a situação representada em um ambiente virtual.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(63, 14, '<p>A vida às vezes é como um jogo brincado na rua:\r\nestamos no último minuto de uma brincadeira bem quente\r\ne não sabemos que a qualquer momento pode chegar um\r\nmais velho a avisar que a brincadeira já acabou e está na\r\nhora de jantar. A vida afinal acontece muito de repente\r\n— nunca ninguém nos avisou que aquele era mesmo o\r\núltimo Carnaval da Vitória. O Carnaval também chegava\r\nsempre de repente. Nós, as crianças, vivíamos num tempo\r\nfora do tempo, sem nunca sabermos dos calendários de\r\nverdade. [...] O “dia da véspera do Carnaval”, como dizia\r\na avó Nhé, era dia de confusão com roupas e pinturas a\r\nserem preparadas, sonhadas e inventadas. Mas quando\r\nacontecia era um dia rápido, porque os dias mágicos\r\npassam depressa deixando marcas fundas na nossa\r\nmemória, que alguns chamam também de coração.</p> <small>ONDJAKI. Os da minha rua. Rio de Janeiro: Língua Geral, 2007.</small><p>As significações afetivas engendradas no fragmento\r\npressupõem o reconhecimento da\r\n</p>', '', 'Intermediária', 'perspectiva infantil assumida pela voz narrativa.', 'suspensão da linearidade temporal da narração.', 'tentativa de materializar lembranças da infância.', 'incidência da memória sobre as imagens narradas.', ' alternância entre impressões subjetivas e relatos factuais.', 'a', 'O narrador incorpora a perspectiva infantil \"Nós as crianças\", que desconhece as datas de comemorações e em tudo \"acontece muito de repente\", \"os dias mágicos passam depressa\". Esses trechos confirmam a perspectiva da criança assumida pelo narrador.', '', 'Linguagens', 3),
(64, 15, '<p>Em 2000 tivemos a primeira experiência do futebol\r\nfeminino em um jogo de videogame, o Mia Hamm\r\nSoccer. Doze anos depois, uma petição on-line pedia\r\nque a EA Sports incluísse o futebol feminino no Fifa 13.\r\nContudo, só em 2015, com uma nova petição on-line,\r\nque arrecadou milhares de assinaturas, tivemos o futebol\r\nfeminino incluído no Fifa 16. Vendo um nicho de mercado\r\ninexplorado, a EA Sports produziu o jogo com 12 seleções\r\nfemininas e o apresentou como inovação. A empresa sabe\r\nque mais de 40% dos praticantes de futebol nos EUA são\r\nmeninas. Para elas, ver o futebol feminino representado\r\nem um jogo de videogame é extremamente importante.\r\nTer o futebol feminino no Fifa 16 é um grande passo para\r\na sua popularização na luta pela igualdade de gênero,\r\nnum contexto machista, sexista, misógino e homofóbico.</p> <small>Disponível em: www.ludopedio.com.br. Acesso em: 5 jun. 2018 (adaptado).</small><p>Os jogos eletrônicos presentes na cultura juvenil podem\r\ndesempenhar uma relevante função na abordagem do futebol ao</p>', '', 'Intermediária', 'disseminarem uma modalidade, promovendo a igualdade de gênero.', 'superarem jogos malsucedidos no mercado, lançados anteriormente. ', 'inovarem a modalidade com novas ofertas de jogos ao mercado', ' explorarem nichos de mercado antes ignorados, produzindo mais lucro.', 'reforçarem estereótipos de gênero masculino ou feminino nos esportes.', 'a', 'O texto apresenta a questão da inclusão do futebol feminino em jogos de videogame, expressando, dessa forma, sua função social de disseminar a modalidade do futebol feminino e, consequentemente, promover a igualdade de gênero.', '', 'Linguagens', 3),
(65, 16, '<p>Slam do Corpo é um encontro pensado para surdos\r\ne ouvintes, existente desde 2014, em São Paulo. Uma\r\niniciativa pioneira do grupo Corposinalizante, criado em\r\n2008. (Antes de seguirmos, vale a explicação: o termo\r\nslam vem do inglês e significa — numa nova acepção\r\npara o verbo geralmente utilizado para dizer “bater com\r\nforça” — a “poesia falada nos ritmos das palavras e da\r\ncidade”). Nos saraus, o primeiro objetivo foi o de botar\r\nos poemas em Libras na roda, colocar os surdos para\r\ncircular e entender esse encontro entre a poesia e a língua\r\nde sinais, compreender o encontro dessas duas línguas.\r\nPoemas de autoria própria, três minutos, um microfone.\r\nSem figurino, nem adereços, nem acompanhamento\r\nmusical. O que vale é modular a voz e o corpo, um\r\ntrabalho artesanal de tornar a palavra “visível”, numa\r\narena cujo objetivo maior é o de emocionar a plateia, tirar\r\no público da passividade, seja pelo humor, horror, caos,\r\ndoçura e outras tantas sensações.</p> <small>NOVELLI, G. Poesia incorporada. Revista Continente, n. 189, set. 2016 (adaptado).\r\n</small> <p>Na prática artística mencionada no texto, o corpo assume\r\npapel de destaque ao articular diferentes linguagens com\r\no intuito de:</p>', '', 'Intermediária', 'imprimir ritmo e visibilidade à expressão poética.', ' redefinir o espaço de circulação da poesia urbana.', ' estimular produções autorais de usuários de Libras.', 'traduzir expressões verbais para a língua de sinais.', 'proporcionar performances estéticas de pessoas surdas.', 'a', 'O Slam do Corpo objetiva tornar a poesia \"visível\", tanto para surdos quanto para ouvintes, por meio da modulação da voz e do movimento do corpo. Portanto, a articulação de linguagem verbal e corporal imprime \"ritmo e visibilidade à expressão poética\".', '', 'Linguagens', 3),
(66, 17, '<p>É possível afirmar que muitas expressões idiomáticas\r\ntransmitidas pela cultura regional possuem autores\r\nanônimos, no entanto, algumas delas surgiram em\r\nconsequência de contextos históricos bem curiosos.\r\n“Aquele é um cabra da peste” é um bom exemplo dessas\r\nconstruções.</p> <p>Para compreender essa expressão tão repetida no\r\nNordeste brasileiro, faz-se necessário voltar o olhar para o\r\nséculo 16. “Cabra” remete à forma com que os navegadores\r\nportugueses chamavam os índios. Já “peste” estaria ligada\r\nà questão da superação e resistência, ou mesmo uma\r\nassociação com o diabo. Assim, com o passar dos anos,\r\npassou-se a utilizar tal expressão para denominar qualquer\r\nindivíduo que se mostre corajoso, ou mesmo insolente, já\r\nque a expressão pode ter caráter positivo ou negativo. Aliás,\r\nquem já não ficou de “nhe-nhe-nhém” por aí? O termo, que\r\nnormalmente tem significado de conversa interminável,\r\nmonótona ou resmungo, tem origem no tupi-guarani e\r\n“nhém” significa “falar”.</p> <small>Disponível em: http://leiturasdahistoria.uol.com.br. Acesso em: 13 dez. 2017.</small><br>A leitura do texto permite ao leitor entrar em contato com:', '', 'Intermediária', 'registros do inventário do português brasileiro.', 'justificativas da variedade linguística do país.', 'influências da fala do nordestino no uso da língua.', 'explorações do falar de um grupo social específico.', 'representações da mudança linguística do português', 'a', 'O texto explica a formação de duas expressões populares utilizadas amplamente no português brasileiro, \"cabra da peste\" e \"nhe-nhe-nhém\", divulgando, dessa forma, ao leitor exemplos compartilhados pelos falantes brasileiros.', '', 'Linguagens', 3),
(67, 18, '<b>O ouro do século 21<br></b><p>Cério, gadolínio, lutécio, promécio e érbio; sumário,\r\ntérbio e disprósio; hólmio, túlio e itérbio. Essa lista de nomes\r\nesquisitos e pouco conhecidos pode parecer a escalação\r\nde um time de futebol, que ainda teria no banco de reservas\r\nlantânio, neodímio, praseodímio, európio, escândio e ítrio.\r\nMas esses 17 metais, chamados de terras-raras, fazem\r\nparte da vida de quase todos os humanos do planeta.\r\nChamados por muitos de “ouro do século 21”, “elementos do\r\nfuturo” ou “vitaminas da indústria”, eles estão nos materiais\r\nusados na fabricação de lâmpadas, telas de computadores,\r\ntablets e celulares, motores de carros elétricos, baterias e\r\naté turbinas eólicas. Apesar de tantas aplicações, o Brasil,\r\ndono da segunda maior reserva do mundo desses metais,\r\nparou de extraí-los e usá-los em 2002. Agora, volta a pensar\r\nem retomar sua exploração.</p> <small>SILVEIRA, E. Disponível em: www.revistaplaneta.com.br.\r\nAcesso em: 6 dez. 2017 (adaptado).</small><br>As aspas sinalizam expressões metafóricas empregadas\r\nintencionalmente pelo autor do texto para:', '', 'Intermediária', 'imprimir um tom irônico à reportagem.', 'incorporar citações de especialistas à reportagem.', 'atribuir maior valor aos metais, objeto da reportagem.', 'esclarecer termos científicos empregados na reportagem.', ' marcar a apropriação de termos de outra ciência pela reportagem.', 'c', 'As expressões \"ouro do século 21\", \"elementos do futuro\" e \"vitaminas da indústria\", apresentadas entre aspas, são utilizadas no texto para reforçar a importância desses metais para a economia nacional. Diante disso, pode-se afirmar que elas são empregadas para enallecer o valor desses metais.', '', 'Linguagens', 3),
(68, 19, '<p>Na sua imaginação perturbada sentia a natureza\r\ntoda agitando-se para sufocá-la. Aumentavam as\r\nsombras. No céu, nuvens colossais e túmidas rolavam\r\npara o abismo do horizonte... Na várzea, ao clarão\r\nindeciso do crepúsculo, os seres tomavam ares de\r\nmonstros... As montanhas, subindo ameaçadoras\r\nda terra, perfilavam-se tenebrosas... Os caminhos,\r\nespreguiçando-se sobre os campos, animavam-se\r\nquais serpentes infinitas... As árvores soltas choravam\r\nao vento, como carpideiras fantásticas da natureza\r\nmorta... Os aflitivos pássaros noturnos gemiam\r\nagouros com pios fúnebres. Maria quis fugir, mas os\r\nmembros cansados não acudiam aos ímpetos do medo\r\ne deixavam-na prostrada em uma angústia desesperada.</p> <small>ARANHA, J. P. G. Canaã. São Paulo: Ática, 1997.</small><br>No trecho, o narrador mobiliza recursos de linguagem que\r\ngeram uma expressividade centrada na percepção da: ', '', 'Intermediária', 'relação entre a natureza opressiva e o desejo de libertação da personagem.', 'confluência entre o estado emocional da personagem e a configuração da paisagem.', 'prevalência do mundo natural em relação à fragilidade humana.', 'depreciação do sentido da vida diante da consciência da morte iminente.', 'instabilidade psicológica da personagem face à realidade hostil.', 'b', 'As expressões \"ouro do século 21\", \"elementos do futuro\" e \"vitaminas da indústria\", apresentadas entre aspas, são utilizadas no texto para reforçar a importância desses metais para a economia nacional. Diante disso, pode-se afirmar que elas são empregadas para enallecer o valor desses metais.', '', 'Linguagens', 3),
(69, 20, '<b>TEXTO I</b><br>\r\nÉ pau, é pedra, é o fim do caminho<br>\r\nÉ um resto de toco, é um pouco sozinho<br>\r\nÉ um caco de vidro, é a vida, é o sol<br>\r\nÉ a noite, é a morte, é o laço, é o anzol<br>\r\nÉ peroba-do-campo, é o nó da madeira<br>\r\nCaingá, candeia, é o matita-pereira<br>\r\n<small>TOM JOBIM. Águas de março. O Tom de Jobim e o tal de João Bosco (disco de bolso).\r\nSalvador: Zen Produtora, 1972 (fragmento)</small><br><b>TEXTO II</b><p>A inspiração súbita e certeira do compositor serve\r\nainda de exemplo do lema antigo: nada vem do nada.\r\nPara ninguém, nem mesmo para Tom Jobim. Duas\r\nfontes são razoavelmente conhecidas. A primeira é o\r\npoema O caçador de esmeraldas, do mestre parnasiano\r\nOlavo Bilac: “Foi em março, ao findar da chuva,\r\nquase à entrada/ do outono, quando a terra em sede\r\nrequeimada/ bebera longamente as águas da estação\r\n[...]”. E a outra é um ponto de macumba, gravado com\r\nsucesso por J. B. Carvalho, do Conjunto Tupi: “É pau, é\r\npedra, é seixo miúdo, roda a baiana por cima de tudo”.\r\nCombinar Olavo Bilac e macumba já seria bom; mas o\r\nque se vê em Águas de março vai muito além: tudo se\r\ntransforma numa outra coisa e numa outra música, que\r\nrecompõem o mundo para nós>/p> <small>NESTROVSKI, A. O samba mais bonito do mundo. In: Três canções de Tom Jobim.\r\nSão Paulo: Cosac Naify, 2004.</small><br>Ao situar a composição no panorama cultural brasileiro, o\r\nTexto II destaca o(a): ', '', 'Intermediária', 'diálogo que a letra da canção estabelece com diferentes tradições da cultura nacional.', 'singularidade com que o compositor converte referências eruditas em populares.', ' caráter inovador com que o compositor concebe o processo de criação artística. ', 'relativização que a letra da canção promove na concepção tradicional de originalidade.', 'resgate que a letra da canção promove de obras pouco conhecidas pelo público no país', 'a', 'No início do texto H, Nestrovski deixa claro que \"nada vem do nada\", \"nem mesmo para Tom Jobim\". Em seguida, o autor mostra que a canção de Tom Jobim \"Aguas de Março\" tem estreita intertextualidade com o poema \"O caçador de esmeraldas\", de Olavo Bilac, e com o ponto de macumba, gravado por J.B. Carvalho. Observa-se, portanto, que a canção de Tom Jobim estabelece diálogo com diferentes tradições da cultura nacional, uma erudita (Olavo Bilac), outra popular (ponto de macumba).', '', 'Linguagens', 3),
(70, 21, '<b>Deu vontade de jogar, mas não sabe como reunir\r\nos amigos...</b><p>Muitas vezes é difícil encontrar grupos para bater\r\numa bola. Em função disso, estão sendo disponibilizados\r\naplicativos que reúnem times e reservam espaços para\r\nos adeptos da paixão nacional. Num exemplo dessas\r\niniciativas, é possível organizar uma partida de futebol,\r\nse inscrever para participar de um jogo, alugar campos e\r\nquadras, convidar jogadores. O aplicativo tem dois tipos\r\nde usuários: um que o usa como ferramenta de gestão\r\ndo grupo, convidando amigos para jogar, vendo quem\r\nconfirmou e avaliando os jogos. Outro usuário é o que\r\nbusca partidas perto de onde ele está, caso de pessoas\r\nque estão de passagem numa cidade.</p> <small>BENEDICTO, M.; MARLI, M. Bola na rede. Retratos:\r\na revista do IBGE, n. 2, 2017 (adaptado).</small> <p>A inter-relação entre tecnologia e sociedade tem\r\nestimulado a criação de aplicativos. Nesse texto, isso é\r\npercebido pelo desenvolvimento de aplicativos para:</p>', '', 'Intermediária', 'organização de eventos de competições esportivas.', 'agendamento de viagens para eventos de esporte amador.', ' mapeamento dos interesses dos praticantes acerca dos esportes.', ' identificação da escassez de espaços para a vivência dos esportes.', 'formação de grupos em comunidades virtuais para a prática esportiva.', 'e', 'O texto \"Deu vontade de jogar, mas não sabe como reunir os amigos...\" apresenta informações sobre aplicativos que \"reúnem times e reservam espaços\" para práticas esportivas.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(71, 22, '<b>Texto II</b> <p>O grupo Jovens Artistas Britânicos (YABs), que surgiu\r\nno final da década de 1980, possui obras diversificadas\r\nque incluem fotografias, instalações, pinturas e carcaças\r\ndesmembradas. O trabalho desses artistas chamou\r\na atenção no final do período da recessão, por utilizar\r\nmateriais incomuns, como esterco de elefantes, sangue\r\ne legumes, o que expressava os detritos da vida e uma\r\natmosfera de niilismo, temperada por um humor mordaz.</p> <small>Disponível em: http://damienhirst.com. Acesso em: 15 jul. 2015.\r\nFARTHING, S. Tudo sobre arte. Rio de Janeiro: Sextante, 2011 (adaptado).</small> <p>A provocação desse grupo gera um debate em torno da\r\nobra de arte pelo(a):</p>', , 'Intermediária', 'recusa a crenças, convicções, valores morais, estéticos e políticos na história moderna.', 'frutífero arsenal de materiais e formas que se relacionam com os objetos construídos.', 'economia e problemas financeiros gerados pela recessão que tiveram grande impacto no mercado.', ' influência desse grupo junto aos estilos pós-modernos que surgiram nos anos 1990.', ' interesse em produtos indesejáveis que revela uma consciência sustentável no mercado', 'b', 'A provocação desse grupo consiste em utilizar nas obras diversos materiais inusitados e alguns escato lógicos, como \"esterco de elefantes\", \"sangue\", os quais se incorporam nos artefatos para expressar os \"detritos da vida\" e uma \"atmosfera niilista\".', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(72, 23, '<p>LUTA: prática corporal imprevisível, caracterizada por\r\ndeterminado estado de contato proposital, que possibilita\r\na duas ou mais pessoas se enfrentarem numa constante\r\ntroca de ações ofensivas e/ou defensivas, regida por\r\nregras, com o objetivo mútuo sobre um alvo móvel\r\npersonifi cado no oponente.</p> <small>GOMES, M. S. P. et al. Ensino das lutas: dos princípios condicionais aos grupos situacionais.\r\nMovimento, n. 2, abr.-jun. 2010 (adaptado).</small> <p>De acordo com o texto, podemos identifi car uma\r\nabordagem das lutas nas aulas de educação física\r\nquando o professor realiza uma proposta envolvendo</p>', '', 'Intermediária', 'contato corporal intenso entre o aluno e seu oponente', 'contenda entre os alunos que se agridem fi sicamente', 'confronto corporal em que os vencedores são previamente identificados.', 'combate corporal intencional com ações regulamentadas entre os oponentes.', 'conflito resolvido pelos alunos por meio de regras previamente estabelecidas.', 'd', 'A definição de luta, tal como aparece no enunciado, mostra que apesar de \"prática corporal imprevisível\". ela (a luta) é regida por regras. Assim, o professor que propõe uma luta como prática esportiva da intencionalidade à prática (uma vez que é atividade escolar orientada) e estabelece regras (regulamentada), já que o objetivo é a prática esportiva.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(73, 24, 'O conceito de saúde formulado na histórica VIII\r\nConferência Nacional de Saúde, no ano de 1986, fi cou\r\nconhecido como um “conceito ampliado” de saúde,\r\nconforme ilustrado na fi gura. Esse conceito foi fruto de\r\nintensa mobilização em diversos países da América\r\nLatina nas décadas de 1970 e 1980, como resposta à\r\ncrise dos sistemas públicos de saúde.\r\n\r\nCom base no conceito apresentado no texto, a saúde é\r\nconsequência direta do(a)', , 'Intermediária', 'adoção de um estilo de vida ativo por parte dos indivíduos', ' disponibilidade de emprego no mercado de trabalho.', ' condição habitacional presente nas cidades', 'acesso ao sistema educacional.', 'forma de organização social.', 'e', 'O conceito ampliado de saúde, citado no texto, é representado no gráfico não só pelo arco \"condições socioeconômicas, culturais e ambientais gerais\", mas tambem por uma outra série de dados enumerados. portanto a saúde é consequência direta da forma de organização social.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(74, 25, '<b>Relatos de viagem: nas curvas da Nacional 222,\r\nem Portugal</b>\r\n\r\n<p>Em abril deste ano, fomos a Portugal para uma\r\nviagem de um mês que esperávamos há um ano. Pois\r\nno dia 4 de maio, chegávamos ao Aeroporto Francisco\r\nSá Carneiro, no Porto. Que linda a “antiga, muy nobre,\r\nsempre leal e invicta” cidade do Porto! “Encantei-me”,\r\ndiriam eles... pelas belas paisagens, construções\r\nhistóricas com lindas fachadas, parques e praças muito\r\nbem cuidados.</p> <p>Os tripeiros, sinônimo de portuenses, têm orgulho\r\nde sua cidade, apelidada de Invicta — nunca foi\r\ninvadida. E valorizam tudo o que há de bom ali,\r\ncomo “a melhor estrada para se dirigir do mundo”, a\r\nNacional 222.</p> <p>Pois na manhã do 25 de abril, dia da Revolução\r\ndos Cravos, resolvemos conhecer a tal maravilha.\r\nA cada 10 km tínhamos que encostar: corríamos,\r\ndançávamos, tomávamos chocolate quente, sopa, tudo\r\nque fosse quentinho. E lá íamos para mais uma etapa.\r\nUma aventura deliciosa. Depois de três horas — mais\r\nou menos o dobro do tempo necessário, não fossem\r\nas paradas para aquecimento —, chegamos a casa!\r\nCongelados, mas maravilhados e invictos!</p> <small>Disponível em: https://oglobo.globo.com. Acesso em: 6 dez. 2017 (adaptado)</small> <p>Nesse texto, busca-se seduzir o leitor por meio da\r\nexploração de uma voz externa sobre a identidade\r\nhistórica do povo português. O trecho que evidencia\r\nesse procedimento argumentativo é:</p>', 0x696d6167656d5f323032332d31312d32305f3035333630313837392e706e67, 'Intermediária', '“Que linda a ‘antiga, muy nobre, sempre leal e invicta’ cidade do Porto!”.', '“‘Encantei-me’, diriam eles... pelas belas paisagens, construções históricas com lindas fachadas [...]”', '“Os tripeiros, sinônimo de portuenses, têm orgulho de sua cidade [...]”.', ' “E valorizam tudo o que há de bom ali, como ‘a melhor estrada para se dirigir do mundo’ [...]”.', ' “Pois na manhã do 25 de abril, dia da Revolução dos Cravos, resolvemos conhecer a tal maravilha”.', 'a', 'O trecho em que se evidencia o uso de uma voz externa que simboliza a identidade histórica do povo português ocorre na seguinte passagem: \"Que linda a antiga, muy nobre, sempre leal e invicta\' cidade do Porto!\"', '', 'Linguagens', 3),
(75, 25, '<b>Relatos de viagem: nas curvas da Nacional 222,\r\nem Portugal</b>\r\n\r\n<p>Em abril deste ano, fomos a Portugal para uma\r\nviagem de um mês que esperávamos há um ano. Pois\r\nno dia 4 de maio, chegávamos ao Aeroporto Francisco\r\nSá Carneiro, no Porto. Que linda a “antiga, muy nobre,\r\nsempre leal e invicta” cidade do Porto! “Encantei-me”,\r\ndiriam eles... pelas belas paisagens, construções\r\nhistóricas com lindas fachadas, parques e praças muito\r\nbem cuidados.</p> <p>Os tripeiros, sinônimo de portuenses, têm orgulho\r\nde sua cidade, apelidada de Invicta — nunca foi\r\ninvadida. E valorizam tudo o que há de bom ali,\r\ncomo “a melhor estrada para se dirigir do mundo”, a\r\nNacional 222.</p> <p>Pois na manhã do 25 de abril, dia da Revolução\r\ndos Cravos, resolvemos conhecer a tal maravilha.\r\nA cada 10 km tínhamos que encostar: corríamos,\r\ndançávamos, tomávamos chocolate quente, sopa, tudo\r\nque fosse quentinho. E lá íamos para mais uma etapa.\r\nUma aventura deliciosa. Depois de três horas — mais\r\nou menos o dobro do tempo necessário, não fossem\r\nas paradas para aquecimento —, chegamos a casa!\r\nCongelados, mas maravilhados e invictos!</p> <small>Disponível em: https://oglobo.globo.com. Acesso em: 6 dez. 2017 (adaptado)</small> <p>Nesse texto, busca-se seduzir o leitor por meio da\r\nexploração de uma voz externa sobre a identidade\r\nhistórica do povo português. O trecho que evidencia\r\nesse procedimento argumentativo é:</p>', 0x696d6167656d5f323032332d31312d32305f3035333630313837392e706e67, 'Intermediária', '“Que linda a ‘antiga, muy nobre, sempre leal e invicta’ cidade do Porto!”.', '“‘Encantei-me’, diriam eles... pelas belas paisagens, construções históricas com lindas fachadas [...]”', '“Os tripeiros, sinônimo de portuenses, têm orgulho de sua cidade [...]”.', ' “E valorizam tudo o que há de bom ali, como ‘a melhor estrada para se dirigir do mundo’ [...]”.', ' “Pois na manhã do 25 de abril, dia da Revolução dos Cravos, resolvemos conhecer a tal maravilha”.', 'a', 'O trecho em que se evidencia o uso de uma voz externa que simboliza a identidade histórica do povo português ocorre na seguinte passagem: \"Que linda a antiga, muy nobre, sempre leal e invicta\' cidade do Porto!\"', '', 'Linguagens', 3),
(76, 26, '<p>Uma das mais contundentes críticas ao discurso\r\nda aptidão física relacionada à saúde está no caráter\r\neminentemente individual de suas propostas, o que\r\nserve para obscurecer outros determinantes da saúde.\r\nOu seja, costuma-se apresentar o indivíduo como o\r\nproblema e a mudança do estilo de vida como a solução.\r\nArgumenta-se ainda que o movimento da aptidão física\r\nrelacionada à saúde considera a existência de uma\r\ncultura homogênea na qual todos seriam livres para\r\nescolher seus estilos de vida, o que não condiz com a\r\nrealidade. O fato é que vivemos numa sociedade dividida\r\nem classes sociais, na qual nem todas as pessoas têm\r\ncondições econômicas para adotar um estilo de vida ativo\r\ne saudável. Há desigualdades estruturais com raízes\r\npolíticas, econômicas e sociais que dificultam a adoção\r\ndesses estilos de vida.</p> <small>FERREIRA, M. S. Aptidão física e saúde na educação física escolar: ampliando o enfoque.\r\nRBCE, n. 2, jan. 2001 (adaptado).</small> <br> Com base no texto, a relação entre saúde e estilos de vida', 0x696d6167656d5f323032332d31312d32305f3035333630313837392e706e67, 'Fácil', 'constrói a ideia de que a mudança individual de hábitos promove a saúde.', 'considera a homogeneidade da escolha de hábitos saudáveis pelos indivíduos.', 'reforça a necessidade de solucionar os problemas de saúde da sociedade com a prática de exercícios.', 'problematiza a organização social e seu impacto na mudança de hábitos dos indivíduos.', 'reproduz a noção de que a melhoria da aptidão física pela prática de exercícios promove a saúde.', 'd', 'O trecho em que se evidencia o uso de uma voz externa que simboliza a identidade histórica do povo português ocorre na seguinte passagem: \"Que linda a antiga, muy nobre, sempre leal e invicta\' cidade do Porto!\"', '', 'Linguagens', 3),
(77, 27, '<b>Retrato de homem</b>\r\nA paisagem estrita<br>\r\nao apuro do muro<br>\r\nfeito vértebra a vértebra<br>\r\ne escuro.<br><br>\r\nA geração dos pelos<br>\r\nsobre a casca e os rostos<br>\r\nem seus diques de sombra<br>\r\nrepostos.<br><br>\r\nOs poços com seu lodo<br>\r\nde ira e de tensão:<br>\r\nentre cimento e fronte<br>\r\n— um vão.<br><br>\r\nAs setas se atiram<br>\r\nàs margens de ninguém,<br>\r\nilesas a si mesmas<br>\r\nretêm.<br><br>\r\nCompassos de evasão<br>\r\nentre falange e rua<br>\r\nsondando a solitude<br>\r\nnua.<br><br>\r\nE na armadura de coisa<br>\r\nsalobra, um só segredo:<br>\r\na polpa toda é fruição<br>\r\nde medo.<br><small>ARAÚJO, L. C. Cantochão. Belo Horizonte: Imprensa Publicações — Governo do Estado\r\nde Minas Gerais, 1967.</small> <p>No poema, a descrição lírica do objeto representado é\r\norientada por um olhar que:</p>', '', 'Fácil', 'desvela sentimentos de vazio e angústia sob a aparente austeridade.', 'expressa desilusão ante a possibilidade de superação do sofrimento.', 'contrapõe a fragilidade emocional ao uso desmedido da força física.', 'associa a incomunicabilidade emocional às determinações culturais.', 'privilegia imagens relacionadas à exposição do dinamismo urbano.', 'a', 'No poema, o homem é descrito de modo a revelar aspectos internos de vazio e angústia. Comprova-se isso por meio de campo semântico formado por termos como \"apuro, escuro, sombra, lodo, vão, ninguém, solitude, coisa salobra\" e, principalmente. nos dois últimos versos \"a polpa toda é fruição de medo,', '', 'Linguagens', 3),
(78, 28, 'Senhor Juiz<br>\r\nO instrumento do “crime” que se arrola<br>\r\nNesse processo de contravenção<br>\r\nNão é faca, revólver ou pistola,<br>\r\nSimplesmente, doutor, é um violão.<br>\r\nSerá crime, afinal, será pecado,<br>\r\nSerá delito de tão vis horrores,<br>\r\nPerambular na rua um desgraçado<br>\r\nDerramando nas praças suas dores?<br>\r\nMande, pois, libertá-lo da agonia<br>\r\n(a consciência assim nos insinua)<br>\r\nNão sufoque o cantar que vem da rua,<br>\r\nQue vem da noite para saudar o dia.<br>\r\nÉ o apelo que aqui lhe dirigimos,<br>\r\nNa certeza do seu acolhimento<br>\r\nJuntada desta aos autos nós pedimos<br>\r\nE pedimos, enfim, deferimento.<br>\r\n<small>Disponível em: www.migalhas.com.br.\r\nAcesso em: 23 set. 2020 (adaptado).</small>\r\n<p>Essa petição de habeas corpus, ao transgredir o rigor da\r\nlinguagem jurídica,</p>', '', 'Intermediária', ' permite que a narrativa seja objetiva e repleta de sentidos denotativos.', ' mostra que o cordel explora termos próprios da esfera do direito.', 'demonstra que o jogo de linguagem proposto atenua a gravidade do delito', 'exemplifica como o texto em forma de cordel compromete a solicitação pretendida', 'esclarece que os termos “crime” e “processo de contravenção” são sinônimos.', 'c', 'Embora se trate de um gênero mais rigoroso quanto à linguagem, a petição mescla o uso linguagem jurídica denotativa com a linguagem metafórica da literatura de cordel, comose nota em \"Derramando nas praças suas dores?\" ou \"libertá-lo da agonia\". Além disso, há a expressividade sonora como se evidencia no ritmo e mas rimas alternadas. Com isso, o mencionado \"crime\", isto é o poeta cantar suas dores com o violão, assume um caráter de menor gravidade.', '', 'Linguagens', 3),
(79, 29, '<p>Quando quis agilizar o processo de seleção de\r\nnovos alunos, a tradicional faculdade britânica de\r\nmedicina St. George usou um software para definir\r\nquem deveria ser entrevistado. Ao reproduzir a forma\r\ncomo os funcionários faziam essa escolha, o programa\r\neliminou, de cara, 60 de 2 000 candidatos. Só por causa\r\ndo sexo ou da origem racial, numa dedução baseada\r\nem sobrenome e local de nascimento. Um estudo sobre\r\no caso foi publicado em 1988, mas, 25 anos depois,\r\noutra pesquisa apontou que esse tipo de discriminação\r\nsegue firme. O exemplo recente envolve o buscador\r\ndo Google: ao digitar nomes comuns entre negros dos\r\nEUA, a chance de os anúncios automáticos oferecerem\r\nchecagem de antecedentes criminais pode aumentar\r\n25%. E pode piorar com a pergunta “detido?” logo após a\r\npalavra procurada.</p> <small>Disponível em: https://tab.uol.com.br. Acesso em: 11 ago. 2017 (adaptado).</small> <p>O texto permite o desnudamento da sociedade ao relacionar as tecnologias de informação e comunicação\r\ncom o(a)</p>', '', 'Fácil', ' agilidade dos softwares.', 'passar dos anos.', ' linguagem.', 'preconceito.', ' educação.', 'd', 'O texto revela que as tecnologias de informação reproduzem o padrão encontrado em sociedade, portanto, ao replicá-lo, a tecnologia desnuda o preconceito social, tal como encontrado no modo de seleção da faculdade britânica e na associação entre nomes de negros nos EUA com a oferta de checagem de antecedentes criminais.', '', 'Linguagens', 3),
(80, 29, '<p>Quando quis agilizar o processo de seleção de\r\nnovos alunos, a tradicional faculdade britânica de\r\nmedicina St. George usou um software para definir\r\nquem deveria ser entrevistado. Ao reproduzir a forma\r\ncomo os funcionários faziam essa escolha, o programa\r\neliminou, de cara, 60 de 2 000 candidatos. Só por causa\r\ndo sexo ou da origem racial, numa dedução baseada\r\nem sobrenome e local de nascimento. Um estudo sobre\r\no caso foi publicado em 1988, mas, 25 anos depois,\r\noutra pesquisa apontou que esse tipo de discriminação\r\nsegue firme. O exemplo recente envolve o buscador\r\ndo Google: ao digitar nomes comuns entre negros dos\r\nEUA, a chance de os anúncios automáticos oferecerem\r\nchecagem de antecedentes criminais pode aumentar\r\n25%. E pode piorar com a pergunta “detido?” logo após a\r\npalavra procurada.</p> <small>Disponível em: https://tab.uol.com.br. Acesso em: 11 ago. 2017 (adaptado).</small> <p>O texto permite o desnudamento da sociedade ao relacionar as tecnologias de informação e comunicação\r\ncom o(a)</p>', '', 'Fácil', ' agilidade dos softwares.', 'passar dos anos.', ' linguagem.', 'preconceito.', ' educação.', 'd', 'O texto revela que as tecnologias de informação reproduzem o padrão encontrado em sociedade, portanto, ao replicá-lo, a tecnologia desnuda o preconceito social, tal como encontrado no modo de seleção da faculdade britânica e na associação entre nomes de negros nos EUA com a oferta de checagem de antecedentes criminais.', '', 'Linguagens', 3),
(81, 30, '<p>Nessa campanha publicitária, a imagem da família e o\r\ntexto verbal unem-se para reforçar a ideia de que:</p>', '', 'Fácil', 'a família que adota é mais feliz.', 'a adoção tardia é muito positiva. ', ' as famílias preferem adotar bebês. ', 'a adoção de adolescentes é mais simples.', 'os filhos adotivos são companheiros dos pais.', 'b', 'O cartaz publicitário sobre adoção apresenta os pais, no centro, cercado pelos filhos adotivos com 13 anos ou mais, incentivando-se, assim, que haja adoção tardia.', '', 'Linguagens', 3),
(82, 31, '<p>Viajo Curitiba das conferências positivistas, elas\r\nsão onze em Curitiba, há treze no mundo inteiro; do\r\ntocador de realejo que não roda a manivela desde que\r\no macaquinho morreu; dos bravos soldados do fogo que\r\npassam chispando no carro vermelho atrás do incêndio\r\nque ninguém não viu, esta Curitiba e a do cachorro-quente\r\ncom chope duplo no Buraco do Tatu eu viajo.</p><p>\r\nCuritiba, aquela do Burro Brabo, um cidadão\r\nmisterioso morreu nos braços da Rosicler, quem foi?\r\nquem não foi? foi o reizinho do Sião; da Ponte Preta da\r\nestação, a única ponte da cidade, sem rio por baixo, esta\r\nCuritiba viajo.</p><p>\r\nCuritiba sem pinheiro ou céu azul, pelo que vosmecê\r\né — província, cárcere, lar —, esta Curitiba, e não a outra\r\npara inglês ver, com amor eu viajo, viajo, viajo.</p>\r\n<small>TREVISAN, D. Em busca de Curitiba perdida. Rio de Janeiro: Record, 1992.\r\n</small>\r\n<p>A tematização de Curitiba é frequente na obra de Dalton\r\nTrevisan. No fragmento, a relação do narrador com o\r\nespaço urbano é caracterizada por um olhar:</p>\r\n', '', 'Intermediária', 'destituído de afetividade, que ironiza os costumes e as tradições da sociedade curitibana', 'marcado pela negatividade, que busca desconstruir perspectivas habituais de representação da cidade.', 'carregado de melancolia, que constata a falta de identidade cultural diante dos impactos da urbanização', ' embevecido pela simplicidade do cenário, indiferente à descrição de elementos de reconhecido valor histórico.', 'distanciado dos elementos narrados, que recorre ao ponto de vista do viajante como expressão de estranhamento.', 'b', 'Dalton Trevisan rejeita as perspectivas com que atualmente se enaltece a cidade de Curitiba, considera-as artificiais, \"para ingles ver\". Prefere aquela cidade mais provinciana, simples. A alternativa dada como correta pelo ENEM aponta a negatividade do olhar do cronista, mas, então, deve ter desconsiderado o final do texto, em que Dalton Trevisan mostra o encantamento e o amor por uma Curitiba, em que ele \"viaja\", sem a ostentação que se arvora de moderna.', '', 'Linguagens', 3),
(83, 32, '<b>Por que a indústria do empreendedorismo de palco\r\nirá destruir você</b>\r\n<p>Se, antigamente, os livros, enormes e com suas\r\nsetecentas páginas, cuspiam fórmulas, equações e\r\ncálculos que te ensinavam a lidar com o fluxo de caixa\r\nda sua empresa, hoje eles dizem: “Você irá chegar lá!\r\nAcredite, você irá vencer!”.</p><p>Mindset, empoderamento, millennials, networking,\r\ncoworking, deal, business, deadline, salesman com\r\nperfil hunter… tudo isso faz parte do seu vocabulário.\r\nO pacote de livros é sempre idêntico e as experiências\r\nsão passadas da mesma forma: você está a um único\r\ncentímetro da vitória. Não pare!</p><p> Se desistir agora, será para sempre. Tome, leia a\r\nestratégia do oceano azul. Faça mais uma mentoria,\r\nparticipe de mais uma sessão de coaching. O problema\r\né que o seu mindset não está ajustado. Você precisa\r\nser mais proativo. Vamos fazer mais um powermind ? Eu\r\nconsigo um precinho bacana para você…</p> <small>CARVALHO, Í. C. Disponível em: https://medium.com.\r\nAcesso em: 17 ago. 2017 (adaptado)</small> <p>De acordo com o texto, é possível identificar o\r\n“empreendedor de palco” por:</p>', '', 'Intermediária', 'livros por ele indicados.', 'suas habilidades em língua inglesa.', 'experiências por ele compartilhadas. ', ' padrões de linguagem por ele utilizados', 'preços acessíveis de seus treinamentos.', 'd', 'O autor refere-se aos livros sobre empreendedorismo e aos clichês e suas variantes que tentam trazer a autoestima e a ação ao leitor. Essa linguagem monó- tona e ostensiva é classificada como \"empreendedorismo de palco\".', '', 'Linguagens', 3),
(84, 33, 'Sou o coração do folclore nordestino<br>\r\nEu sou Mateus e Bastião do Boi-bumbá<br>\r\nSou o boneco de Mestre Vitalino<br>\r\nDançando uma ciranda em Itamaracá<br>\r\nEu sou um verso de Carlos Pena Filho<br>\r\nNum frevo de Capiba<br>\r\nAo som da Orquestra Armorial<br>\r\nSou Capibaribe<br>\r\nNum livro de João Cabral<br>\r\nSou mamulengo de São Bento do Una<br>\r\nVindo no baque solto de maracatu<br>\r\nEu sou um auto de Ariano Suassuna<br>\r\nNo meio da Feira de Caruaru<br>\r\nSou Frei Caneca do Pastoril do Faceta<br>\r\nLevando a flor da lira<br>\r\nPra Nova Jerusalém<br>\r\nSou Luiz Gonzaga<br>\r\nE sou do mangue também<br>\r\nEu sou mameluco, sou de Casa Forte<br>\r\nSou de Pernambuco, sou o Leão do Norte<br> <small>LENINE; PINHEIRO, P.C. Leão do Norte. In: LENINE; SUZANO, M. Olho de peixe.\r\nSão Paulo: Velas, 1993 (fragmento).</small> <p>O fragmento faz parte da canção brasileira contemporânea\r\ne celebra a cultura popular nordestina. Nele, o artista\r\nexalta as diferentes manifestações culturais pela:</p>', '', 'Intermediária', 'valorização do teatro, música, artesanato, literatura, dança, personagens históricos e artistas populares, compondo um tecido diversificado e enriquecedor da cultura popular como patrimônio regional e nacional.', 'identificação dos lugares pernambucanos, manifestações culturais, como o bumba meu boi, as cirandas, os bonecos mamulengos e heróis locais, fazendo com que essa canção se apresente como uma referência à cultura popular nordestina.', 'exaltação das raízes populares, como a poesia, a literatura de cordel e o frevo, misturadas ao erudito, como a Orquestra Armorial, compondo um rico tecido cultural, que transforma o popular em erudito.', 'caracterização das festas populares como identidade cultural localizada e como representantes de uma cultura que reflete valores históricos e sociais próprios da população local.', 'apresentação do Pastoril do Faceta, do maracatu, do bumba meu boi e dos autos como representação da musicalidade e do teatro popular religioso, bastante comum ao folclore brasileiro.', 'b', 'A letra da canção Leão do Norte apresenta personagens históricos, artistas, populares e eruditos, como João Cabral de Melo Neto, fazendo referência à cultura não só pernambucana, mas também à nordestina e, obviamente, à brasileira. Frise-se que o poeta João Cabral de Melo Neto, construtivista, avesso à expansão emocional, não é pertencente à cultura popular. embora tematize cerebralmente o sertanejo, e o ser desprovido de recursos econômicos. A sua poesia é influenciada pela arquitetura de Le Corbusier.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(85, 34, 'Esse anúncio publicitário propõe soluções para um\r\nproblema social recorrente, ao:', , 'Fácil', ' promover ações de conscientização para reduzir a violência de gênero em eventos esportivos.', 'estimular o compartilhamento de políticas públicas sobre a igualdade de gênero no esporte.', 'divulgar para a população as novas regras complementares para as torcidas de futebol.', 'informar ao público masculino as consequências de condutas ofensivas.', 'regulamentar normas de boa convivência nos estádios.', 'a', 'As torcedoras tem buscado seu espaço nas arquibancadas. Elas esperam atitudes respeitosas por parte dos outros torcedores, o que conduziria o quadro à redução da violência de gênero. Assim, o anúncio promoveria conscientização para alcançar o respeito de género em eventos esportivos.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(86, 35, '<p>Vou-me embora p’ra Pasárgada foi o poema de\r\nmais longa gestação em toda a minha obra. Vi pela\r\nprimeira vez esse nome Pasárgada quando tinha os\r\nmeus dezesseis anos e foi num autor grego. [...] Esse\r\nnome de Pasárgada, que significa “campo dos persas”\r\nou “tesouro dos persas”, suscitou na minha imaginação\r\numa paisagem fabulosa, um país de delícias, como o\r\nde L’invitation au Voyage, de Baudelaire. Mais de vinte\r\nanos depois, quando eu morava só na minha casa da\r\nRua do Curvelo, num momento de fundo desânimo,\r\nda mais aguda sensação de tudo o que eu não tinha\r\nfeito em minha vida por motivo da doença, saltou-me\r\nde súbito do subconsciente este grito estapafúrdio:\r\n“Vou-me embora p’ra Pasárgada!” Senti na redondilha\r\na primeira célula de um poema, e tentei realizá-lo,\r\nmas fracassei. Alguns anos depois, em idênticas\r\ncircunstâncias de desalento e tédio, me ocorreu o\r\nmesmo desabafo de evasão da “vida besta”. Desta vez\r\no poema saiu sem esforço como se já estivesse pronto\r\ndentro de mim. Gosto desse poema porque vejo nele,\r\nem escorço, toda a minha vida; [...] Não sou arquiteto,\r\ncomo meu pai desejava, não fiz nenhuma casa, mas\r\nreconstruí e “não de uma forma imperfeita neste mundo\r\nde aparências”, uma cidade ilustre, que hoje não é mais\r\na Pasárgada de Ciro, e sim a “minha” Pasárgada.</p> <small>BANDEIRA, M. Itinerário de Pasárgada. Rio de Janeiro: Nova Fronteira; Brasília: INL, 1984.\r\n</small> <p>Os processos de interação comunicativa preveem a\r\npresença ativa de múltiplos elementos da comunicação,\r\nentre os quais se destacam as funções da linguagem.\r\nNesse fragmento, a função da linguagem predominante é a:</p>', '', 'Intermediária', 'emotiva, porque o poeta expõe os sentimentos de angústia que o levaram à criação poética. ', 'referencial, porque o texto informa sobre a origem do nome empregado em um famoso poema de Bandeira.', ' metalinguística, porque o poeta tece comentários sobre a gênese e o processo de escrita de um de seus poemas.', 'poética, porque o texto aborda os elementos estéticos de um dos poemas mais conhecidos de Bandeira.', 'apelativa, porque o poeta tenta convencer os leitores sobre sua dificuldade de compor um poema.', 'c', 'No texto, a função da linguagem predominante é a metalinguística, pois Manuel Bandeira tece comentários sobre a origem e o processo de escrita de seu poema \"Vou-me embora pra Pasárgada\".', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(87, 36, '<p>A frase, título do filme, reproduz uma variedade\r\nlinguística recorrente na fala de muitos brasileiros.\r\nEssa estrutura caracteriza-se pelo(a):</p>\r\n', , 'Fácil', 'uso de uma marcação temporal.', 'imprecisão do referente de pessoa.', 'organização interrogativa da frase.', 'utilização de um verbo de ação.', 'apagamento de uma preposição.', 'e', 'A frase título do filme reproduz uma variedade linguistica recorrente na fala de muitos brasileiros, caracterizada pelo apagamento da preposição \"a\" exigida pelo verbo \"voltar\": \"A que horas ela volta?\"', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(88, 37, '<b>Hino à Bandeira</b>\r\nEm teu seio formoso retratas<br>\r\nEste céu de puríssimo azul,<br>\r\nA verdura sem par destas matas,<br>\r\nE o esplendor do Cruzeiro do Sul.<br>\r\nContemplando o teu vulto sagrado,<br>\r\nCompreendemos o nosso dever,<br>\r\nE o Brasil por seus filhos amado,<br>\r\nPoderoso e feliz há de ser!<br>\r\nSobre a imensa Nação Brasileira,<br>\r\nNos momentos de festa ou de dor,<br>\r\nPaira sempre sagrada bandeira<br>\r\nPavilhão da justiça e do amor!<br> <small>BILAC, O.; BRAGA, F. Disponível em: www2.planalto.gov.br.\r\nAcesso em: 10 dez. 2017 (fragmento).</small> <p>No Hino à Bandeira, a descrição é um recurso utilizado\r\npara exaltar o símbolo nacional na medida em que</p>\r\n', '', 'Fácil', 'remete a um momento futuro', 'promove a união dos cidadãos.', 'valoriza os seus elementos.', 'emprega termos religiosos.', 'recorre à sua história.', 'c', 'No \"Hino à Bandeira\", nota-se, por meio da descrição, a valorização dos elementos cromáticos, comparando-os com o contexto natural do Brasil, como exemplifica a associação da cor verde com a expressividade da mata', '', 'Linguagens', 3),
(89, 38, '<p>— O senhor pensa que eu tenho alguma fábrica de\r\ndinheiro? (O diretor diz essas coisas a ele, mas olha\r\npara todos como quem quer dar uma explicação a todos.\r\nTodas as caras sorriem.) Quando seu filho esteve doente,\r\neu o ajudei como pude. Não me peça mais nada. Não me\r\nencarregue de pagar as suas contas: já tenho as minhas,\r\ne é o que me basta... (Risos.)</p><p>\r\nO diretor tem o rosto escanhoado, a camisa limpa. A\r\npalavra possui um tom educado, de pessoa que convive\r\ncom gente inteligente, causeuse. O rosto do Dr. Rist\r\nresplandece, vermelho e glabro. Um que outro tem os\r\nolhos no chão, a atitude discreta.</p><p>\r\nNaziazeno espera que ele lhe dê as costas, vá reatar\r\na palestra interrompida, aquelas observações sobre a\r\nquestão social, comunismo e integralismo.</p><small>MACHADO, D. Os ratos. São Paulo: Círculo do Livro, s/d.</small> <p>A ficção modernista explorou tipos humanos em situação\r\nde conflito social. No fragmento do romancista gaúcho,\r\nesse conflito revela a:/p>\r\n', '', 'Intermediária', ' sujeição moral amplificada pela pobreza.', ' crise econômica em expansão nas cidades.', 'falta de diálogo entre patrões e empregados', 'perspicácia marcada pela formação intelectual.', ' tensão política gerada pelas ideologias vigentes.', 'a', 'No início do texto, a fala do diretor constrange o funcionário, que apenas olha para o chão, acatando a crítica de forma resignada.', '', 'Linguagens', 3),
(90, 39, '<p>Policarpo Quaresma, cidadão brasileiro, funcionário\r\npúblico, certo de que a língua portuguesa é emprestada\r\nao Brasil; certo também de que, por esse fato, o\r\nfalar e o escrever em geral, sobretudo no campo das\r\nletras, se veem na humilhante contingência de sofrer\r\ncontinuamente censuras ásperas dos proprietários da\r\nlíngua; sabendo, além, que, dentro do nosso país, os\r\nautores e os escritores, com especialidade os gramáticos,\r\nnão se entendem no tocante à correção gramatical,\r\nvendo-se, diariamente, surgir azedas polêmicas entre os\r\nmais profundos estudiosos do nosso idioma — usando\r\ndo direito que lhe confere a Constituição, vem pedir que\r\no Congresso Nacional decrete o tupi-guarani como língua\r\noficial e nacional do povo brasileiro.\r\n</p><small>BARRETO, L. Triste fim de Policarpo Quaresma.\r\nDisponível em: www.dominiopublico.gov.br. Acesso em: 26 jun. 2012</small> <p>Nessa petição da pitoresca personagem do romance de\r\nLima Barreto, o uso da norma-padrão justifica-se pela:/p>\r\n', '', 'Intermediária', 'situação social de enunciação representada.', 'divergência teórica entre gramáticos e literatos.', 'pouca representatividade das línguas indígenas.', ' atitude irônica diante da língua dos colonizadores.', ' tentativa de solicitação do documento demandado.', 'a', 'O trecho apresentado de \"Triste Fim de Policarpo Quaresma\" representa a tentativa de Policarpo Quaresma, protagonista, reivindicar a mudança da lingua nacional do português para o tupi. Como se trata de um contexto formal, uma vez que se dirige ao Congresso Nacional, ele utiliza em seu requerimento a modalidade culta da Língua Portuguesa.', '', 'Linguagens', 3),
(91, 40, '<p>Atualmente os jovens estão imersos numa sociedade\r\npermeada pela tecnologia. Nesse contexto, os jogos\r\ndigitais são artefatos muito empregados. Videogames\r\nativos ou exergames foram introduzidos como forma\r\nde permitir que o corpo controlasse tais jogos. Como\r\nresultado, passaram a ser vistos como uma ferramenta\r\nauxiliar na adoção de um estilo de vida menos sedentário,\r\ncom efeitos positivos sobre a saúde. Tem-se defendido\r\nque os exergames podem contribuir para a prática regular\r\nde atividade física moderada, bem como promover a\r\ninteração entre jogadores, reduzindo o sentimento de\r\nisolamento social. Por outro lado, argumenta-se que os\r\nexergames não podem substituir a experiência real das\r\npráticas corporais, pois não motivam a longo prazo a\r\nprática permanente de atividades físicas.</p>\r\n\r\n<small>FINCO, M. D.; REATEGUI, E. B.; ZARO, M. A. Laboratório de exergames: um espaço\r\ncomplementar para as aulas de educação física. Movimento, n. 3, 2015 (adaptado).</small> \r\n\r\n<p>Pela sua interatividade, os exergames apresentam-se\r\ncomo possibilidade para estimular o(a):/p>\r\n', '', 'Intermediária', 'exercitação física, promovendo a saúde.', 'vivência de exercícios físicos sistemáticos.', 'envolvimento com atividades físicas ao longo da vida.', 'jogo por meio de comandos fornecidos pelo videogame.', 'disputa entre jogadores, contribuindo para o individualismo.', 'a', 'De acordo com o texto, os exergames, por permitirem que o corpo controle os jogos, contribuem para a prática de exercícios físicos e tornam-se ferramentas para que se tenha um estilo de vida menos sedentário e mais saudável.', '', 'Linguagens', 3),
(92, 41, 'Caminhando contra o vento,<br>\r\nSem lenço e sem documento<br>\r\nNo sol de quase dezembro<br>\r\nEu vou<br><br>\r\nO sol se reparte em crimes<br>\r\nEspaçonaves, guerrilhas<br>\r\nEm cardinales bonitas<br>\r\nEu vou<br><br>\r\nEm caras de presidentes<br>\r\nEm grandes beijos de amor<br>\r\nEm dentes, pernas, bandeiras<br>\r\nBombas e Brigitte Bardot<br>\r\nO sol nas bancas de revista<br>\r\nMe enche de alegria e preguiça<br>\r\nQuem lê tanta notícia<br>\r\nEu vou<br>\r\n\r\n<small>VELOSO, C. Alegria, alegria. In: Caetano Veloso.\r\nSão Paulo: Phillips, 1967 (fragmento).</small> \r\n\r\n<p>É comum coexistirem sequências tipológicas em um\r\nmesmo gênero textual. Nesse fragmento, os tipos textuais\r\nque se destacam na organização temática são:/p>\r\n', '', 'Intermediária', 'descritivo e argumentativo, pois o enunciador detalha cada lugar por onde passa, argumentando contra a violência urbana.', ' dissertativo e argumentativo, pois o enunciador apresenta seu ponto de vista sobre as notícias relativas à cidade.', ' expositivo e injuntivo, pois o enunciador fala de seus estados físicos e psicológicos e interage com a mulher amada.', 'narrativo e descritivo, pois o enunciador conta sobre suas andanças pelas ruas da cidade ao mesmo tempo que a descreve.', 'narrativo e injuntivo, pois o enunciador ensina o interlocutor como andar pelas ruas da cidade contando sobre sua própria experiência', 'd', 'Há, nesse fragmento, segmentos narrativos e descritivos. O elemento narrativo desse texto diz respeito à aventura do enunciador, expressa por verbos de ação, percorrendo as ruas de uma cidade. Durante sua trajetória, ele vai descrevendo elementos que o impactam e lhe causam fascínio e perplexidade. como as muitas imagens constantes das revistas de bancas de jornal.', '', 'Linguagens', 3),
(93, 42, '<p>Leandro Aparecido Ferreira, o MC Fioti, compôs em\r\n2017 a música Bum bum tam tam, que gerou, em nove\r\nmeses, 480 milhões de visualizações no YouTube. É o\r\nfunk brasileiro mais ouvido na história do site.</p>\r\n\r\n<p>A partir de uma gravação da flauta que achou na\r\ninternet, MC Fioti fez tudo sozinho: compôs, cantou e\r\nproduziu em uma noite só. “Comecei a pesquisar alguns\r\ntipos de flauta, coisas antigas. E nisso eu achei a ‘flautinha\r\ndo Sebastian Bach’”, conta. A descoberta foi por acaso:\r\nFioti não sabia quem era o músico alemão e não sabe\r\ntocar o instrumento.</p>\r\n\r\n<p>A “flauta envolvente” da música é um trecho da Partita\r\nem Lá menor, escrita pelo alemão Johann Sebastian\r\nBach por volta de 1723.</p>\r\n\r\n<small>Disponível em: https://g1.globo.com. Acesso em: 6 jun. 2018 (adaptado).</small> \r\n\r\n<p>A incorporação de um trecho da obra para flauta solo de\r\nJohann Sebastian Bach na música de MC Fioti demonstra a/p>\r\n', '', 'Intermediária', 'influência permanente da cultura eurocêntrica nas produções musicais brasileiras.', 'homenagem aos referenciais estéticos que deram origem às produções da música popular.', 'necessidade de divulgar a música de concerto nos meios populares nas periferias das grandes cidades.', 'utilização desintencional de uma música excessivamente distante da realidade cultural dos jovens brasileiros', 'inter-relação de elementos culturais vindos de realidades distintas na construção de uma nova proposta musical.', 'e', 'MC Fioti, no utilizar em sua composição um trecho de uma música do compositor do barroco alemão Johann Sebastian Bach (séc. XVII), exemplifica possibilidade de elementos culturais advindos de realidades diversas se conjugarem. No caso do funkeiro brasileiro, sua música refere-se a uma realidade popular e brasileira; a música de Bach, por sua vez, remete a uma realidade europeia, marcada pela crudição. A pesquisa de MC Fioti permitiu o encontro entre esses dois universos tão distantes.', '', 'Linguagens', 3),
(94, 43, '<b>Seu delegado</b><br>\r\nEu sou viúvo e tenho um filho homem <br>\r\nArrumei uma viúva e fui me casar<br>\r\nA minha sogra era muito teimosa<br>\r\nCom o meu filho foi se matrimoniar<br>\r\nDesse matrimônio nasceu um garoto<br>\r\nDesde esse dia que eu ando é louco<br>\r\nEsse garoto é filho do meu filho<br>\r\nE o filho da minha sogra é irmão da minha mulher<br>\r\nEle é meu neto e eu sou cunhado dele<br>\r\nA minha nora é minha sogra<br>\r\nMeu filho meu sogro é<br>\r\nNessa confusão já nem sei quem sou<br>\r\nAcaba esse garoto sendo meu avô.<br>\r\n\r\n<small>TRIO FORROZÃO. Agitando a rapaziada.\r\nRio de Janeiro: Natasha Records, 2009..</small> \r\n\r\n<p>Nessa letra da canção, a suposição do último verso\r\nsinaliza a intenção do autor de:/p>\r\n', '', 'Fácil', 'ironizar as relações familiares modernas.', 'reforçar o humor da situação representada.', 'expressar perplexidade em relação ao parente.', 'atribuir à criança a causa da dúvida existencial.', ' questionar os lugares predeterminados da família.', 'b', 'A canção \"Seu delegado\" narra uma história de humor, em que o filho do enunciador casa-se com sua sogra. Diante da situação, ele se vê perdido em relação aos graus de parentesco, o que reforça o tom de humor da letra da canção.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(95, 44, '<p>O suor para estar em competições nacionais e\r\ninternacionais de alto nível é o mesmo para homens e\r\nmulheres, mas não raramente as remunerações são\r\nmenores para elas. Se no tênis, um dos esportes mais\r\nequânimes em termos de gênero, todos os principais\r\ntorneios oferecem prêmios idênticos nas disputas\r\nfemininas e masculinas, no futebol a desigualdade atinge\r\nseu ápice. Neymar e Marta são dois expoentes dessa\r\npaixão nacional. Ela já foi eleita cinco vezes a melhor\r\njogadora do mundo pela Fifa. Ele conquistou o terceiro\r\nlugar na última votação para melhor do mundo. Mas é na\r\nconta bancária que a diferença entre os dois se sobressai.</p>\r\n\r\n\r\n<p>O esporte é uma manifestação cultural na qual se\r\nestabelecem relações sociais. Considerando o texto, o\r\nfutebol é uma modalidade que:/p>\r\n', , 'Intermediária', 'apresenta proximidades com o tênis, no que tange às relações de gênero entre homens e mulheres.', 'se caracteriza por uma identidade masculina no Brasil, conferindo maior remuneração aos jogadores', ' traz remunerações, aos jogadores e jogadoras, proporcionais aos seus esforços no treinamento esportivo.', 'resulta em melhor eficiência para as mulheres e, consequentemente, em remuneração mais alta às jogadoras.', ' possui jogadores e jogadoras com a mesma visibilidade, apesar de haver expoentes femininas de destaque, como Marta.', 'b', 'O futebol, no Brasil, é associado culturalmente à identidade masculina e isso se reflete, consequentemente, na remuneração diferente dos jogadores baseado, unicamente, no gênero: jogadores, como Neymar, costumam ter salários milionários, enquanto as jogadoras, como Marta, não têm uma remuneração equivalente, tal como evidenciado na imagem apresentada.', '', 'Linguagens', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(96, 45, '<p>Fomos falar com o tal encarregado, depois com um\r\nengenheiro, depois com um supervisor que mandou\r\nchamar um engenheiro da nossa companhia. Esses\r\nhomens são da sua companhia, engenheiro, ele falou,\r\nestão pedindo a conta. A companhia está empenhada\r\nnessa ponte, gente, falou o engenheiro, vocês não\r\npodem sair assim sem mais nem menos. Tinha uma\r\nserra circular cortando uns caibros ali perto, então\r\nsó dava pra falar quando a serra parava, e aquilo foi\r\ndando nos nervos.</p>\r\n<p>Falei que a gente tinha o direito de sair quando a\r\ngente quisesse, e pronto. Nisso encostou um sujeito\r\nde paletó mas sem gravata, o engenheiro continuou\r\nfalando e a serra cortando. Quando ele parou de falar,\r\n50 Volts aproveitou uma parada da serra e falou que\r\na gente não era bicho pra trabalhar daquele jeito; daí\r\no supervisor falou que, se era falta de mulher, eles\r\ndavam um jeito. O engenheiro falou que tinha mais\r\nde vinte companhias trabalhando na ponte, a maioria\r\ncom prejuízo, porque era mais uma questão de honra,\r\na gente tinha de acabar a ponte, a nossa companhia\r\nnunca ia esquecer nosso trabalho ali naquela ponte,\r\num orgulho nacional.</p>\r\n\r\n<small>PELLEGRINI, D. A maior ponte do mundo. In:\r\nMelhores contos. São Paulo: Global, 2005.</small>\r\n\r\n<p>As reivindicações dos operários, quanto às condições\r\naviltantes de trabalho a que são submetidos, recebem\r\nalgumas tentativas de neutralização dos representantes\r\ndo empregador, das quais a mais forte é o(a):/p>\r\n', '', 'Intermediária', 'sequência de atribuição de responsabilidades e de poder decisório a terceiros.', 'solicitação em nome dos prejuízos e compromissos para entrega da obra.', 'intimidação pela discreta presença de um agente de segurança na cena.', 'promessa de imediato atendimento da carência sexual dos operários.', ' apelo pela identificação com a empresa extensiva ao amor patriótico', 'e', 'A tentativa de neutralização das reivindicações dos operários, a qual se mostra de forma mais intensa. está no apelo dos representantes do empregador ao sentimento patriótico dos trabalhadores, como se nota em \"a nossa companhia nunca ia esquecer nosso rabalho ali naquela ponte, um orgulho nacional\".', '', 'Linguagens', 3),
(97, 46, '<p>O movimento sedicioso ocorrido na capitania\r\nde Pernambuco, no ano 1817, foi analisado de\r\nformas diferentes por dois meios de comunicação\r\ndaquela época. O Correio Braziliense apontou para\r\no fato de ser “a comoção no Brasil motivada por um\r\ndescontentamento geral, e não por maquinações de\r\nalguns indivíduos”. Já a Gazeta do Rio de Janeiro\r\nconsiderou o movimento como um “pontual desvio\r\nde norma, apenas uma ‘mancha’ nas ‘páginas da\r\nHistória Portuguesa’, tão distinta pelos testemunhos\r\nde amor e respeito que os vassalos desta nação\r\nconsagram ao seu soberano”</p>\r\n\r\n<small>JANCSÓ, I.; PIMENTA, J. P. Peças de um mosaico. In: MOTA, C. G. (Org.). Viagem Incompleta:\r\na experiência brasileira (1500-2000). São Paulo: Senac, 2000 (adaptado).</small>\r\n\r\n<p>Os fragmentos das matérias jornalísticas sobre o\r\nacontecimento, embora com percepções diversas,\r\nrelacionam-se a um aspecto do processo de\r\nindependência da colônia luso-americana expresso\r\nem dissensões entre/p>\r\n', '', 'Intermediária', ' quadros dirigentes em torno da abolição da ordem escravocrata.', 'grupos regionais acerca da configuração político-territorial.', 'intelectuais laicos acerca da revogação do domínio eclesiástico.', 'homens livres em torno da extensão do direito de voto', 'elites locais acerca da ordenação do monopólio fundiário.', 'e', 'A Revolução Pernambucana de 1817, por se encaixar no processo de emancipação político-brasileiro, refletia. ainda que de forma regional, um projeto das elites locais no sentido de separar o Nordeste do Reino Unido, criado em 1815 e colocado sob a hegemonia de Portugal. Obs.: O jornal Correio Braziliense era editado em português na cidade de Londres, pelo brasileiro Hipólito da Costa.', '', 'Ciências Humanas', 3),
(98, 47, '<b>Declaração de Direitos do Homem e do Cidadão – 1789</b>\r\n<p>Os representantes do povo francês, tendo em vista\r\nque a ignorância, o esquecimento ou o desprezo dos\r\ndireitos do homem são as únicas causas dos males\r\npúblicos e da corrupção dos governos, resolveram\r\ndeclarar solenemente os direitos naturais, inalienáveis e\r\nsagrados do homem, a fim de que esta declaração, sempre\r\npresente em todos os membros do corpo social, lhes\r\nlembre permanentemente seus direitos e seus deveres; a\r\nfim de que as reivindicações dos cidadãos, fundadas em\r\nprincípios simples e incontestáveis, se dirijam sempre à\r\nconservação da Constituição e à felicidade geral.</p>\r\n\r\n<small>Disponível em: www.direitoshumanosusp.br. Acesso em: 7 jun. 2018 (adaptado).</small>\r\n\r\n<p>Esse documento, elaborado no contexto da Revolução\r\nFrancesa, reflete uma profunda mudança social ao\r\nestabelecer a:/p>\r\n', '', 'Fácil', 'manutenção das terras comunais.', 'supressão do poder constituinte.', 'falência da sociedade burguesa.', 'paridade do tratamento jurídico.', 'abolição dos partidos políticos.', 'd', 'A Declaração dos Direitos do Homem e do Cidadão, Formulada pela Assembleia Constituinte Francesa em 789, foi fortemente influenciada pelos princípios do iluminismo, baseados na liberdade dos cidadãos e na igualdade de todos perante a lei. Tais princípios, estabelecidos no documento citado, puseram fim à estrutura de opressão e privilégios que caracterizava Antigo Regime na França.', '', 'Ciências Humanas', 3),
(100, 48, '<p>Na Grécia, o conceito de povo abrange tão\r\nsomente aqueles indivíduos considerados cidadãos.\r\nAssim é possível perceber que o conceito de povo era\r\nmuito restritivo. Mesmo tendo isso em conta, a forma\r\ndemocrática vivenciada e experimentada pelos gregos\r\natenienses nos séculos IV e V a.C. pode ser caracterizada,\r\nfundamentalmente, como direta.</p>\r\n\r\n<small>MANDUCO, A. Ciência política. São Paulo: Saraiva, 2011.</small>\r\n\r\n<p>Naquele contexto, a emergência do sistema de governo\r\nmencionado no excerto promoveu o(a):/p>\r\n', '', 'Intermediária', 'competição para a escolha de representantes.', 'campanha pela revitalização das oligarquias.', 'estabelecimento de mandatos temporários.', 'declínio da sociedade civil organizada.', 'participação no exercício do poder.', 'e', 'Na democracia ateniense existiam alguns cargos eletivos, geralmente de caráter administrativo ou judiciário. Todavia, o processo democrático ateniense deve ser considerado direto, pois as decisões mais importantes relacionadas com a pólis eram tomadas pela Apela, isto é, pela assembleia geral dos cidadãos reunidos em condição de igualdade. Estes últimos. para gozar do direito de cidadania, deviam ser homens livres, maiores de idade, nascidos em Atenas e filhos de pai ateniense.\r\n', '', 'Ciências Humanas', 3),
(101, 49, '<b>O cântico da Terra</b>\r\nEu sou a terra, eu sou a vida.<br>\r\nA ti, ó lavrador, tudo quanto é meu.<br>\r\nTeu arado, tua foice, teu machado.<br>\r\nO berço pequenino de teu filho.<br>\r\nO algodão de tua veste<br>\r\ne o pão de tua casa.<br>\r\nE um dia bem distante<br>\r\na mim tu voltarás.<br>\r\nE no canteiro materno de meu seio<br>\r\ntranquilo dormirás.<br>\r\nPlantemos a roça.<br>\r\nLavremos a gleba.<br>\r\n\r\n<small>CORALINA, C. Textos e contextos: poemas dos becos de Goiás e estórias mais.\r\nSão Paulo: Global, 1997 (fragmento).</small>\r\n\r\n<p>No contexto das distintas formas de apropriação da terra,\r\no poema de Cora Coralina valoriza a relação entre:/p>\r\n', '', 'Intermediária', ' grileiros e controle territorial.', ' meeiros e divisão do trabalho.', ' camponeses e uso da natureza.', 'indígenas e manejo agroecológico', ' latifundiários e fertilização do solo.', 'c', 'No contexto das distintas formas de apropriação da terra, o poema \"O cântico da terra\" valoriza a relação entre os camponeses, ao falar do lavrador, do seu arado, da sua foice, do seu machado e do uso da terra.', '', 'Ciências Humanas', 3),
(102, 50, '<p>Montaigne deu o nome para um novo gênero\r\nliterário; foi dos primeiros a instituir na literatura\r\nmoderna um espaço privado, o espaço do “eu”, do texto\r\níntimo. Ele cria um novo processo de escrita filosófica,\r\nno qual hesitações, autocríticas, correções entram no\r\npróprio texto.\r\n</p>\r\n\r\n<small>COELHO, M. Montaigne. São Paulo: Publifolha, 2001 (adaptado)</small>\r\n\r\n<p>O novo gênero de escrita aludido no texto é o(a):/p>\r\n', '', 'Intermediária', ' confissão, que relata experiências de transformação.', ' ensaio, que expõe concepções subjetivas de um tema. ', 'carta, que comunica informações para um conhecido.', 'meditação, que propõe preparações para o conhecimento.', 'diálogo, que discute assuntos com diferentes interlocutores.', 'b', 'Michel de Montaigne ficou conhecido pela sua obra Essais (\"Ensaios\"), textos nos quais desenvolve temas partindo de seu ponto de vista, como a dor, a morte, a medicina, a sabedoria e, inclusive, assuntos domésticos.', '', 'Ciências Humanas', 3),
(103, 51, '<b>Declaração de Salamanca – 1994</b>\r\n\r\n<p>Acreditamos e proclamamos que: toda criança\r\ntem direito fundamental à educação e deve ser dada\r\na oportunidade de atingir e manter o nível adequado\r\nde aprendizagem; toda criança possui características,\r\ninteresses, habilidades e necessidades de aprendizagem\r\nque são únicas; sistemas educacionais deveriam ser\r\ndesignados e programas educacionais deveriam ser\r\nimplementados no sentido de se levar em conta a vasta\r\ndiversidade de tais características e necessidades.\r\n</p>\r\n\r\n<smallDisponível em: http://portal.mec.gov.br. Acesso em: 4 out. 2015</small>\r\n\r\n<p>Como signatário da Declaração citada, o Brasil\r\ncomprometeu-se com a elaboração de políticas públicas\r\neducacionais que contemplem a:/p>\r\n', '', 'Intermediária', 'criação de privilégios.', 'contenção dos gastos.', ' pluralidade dos sujeitos.', ' padronização do currículo.', 'valorização da meritocracia.', 'c', 'A declaração contida no texto (Salamanca) foi precursora na discussão sobre o indivíduo e seu universo, bem como em relação ao acesso amplo à educação como direito, logo, diz respeito à pluralidade e a políticas de inclusão.', '', 'Ciências Humanas', 3),
(104, 52, '<b>TEXTO I/b><br>\r\nOs meus pensamentos são todos sensações.<br>\r\nPenso com os olhos e com os ouvidos<br>\r\nE com as mãos e os pés<br>\r\nE com o nariz e a boca.<br>\r\n<small>PESSOA, F. O guardador de rebanhos – IX. In: GALHOZ, M. A. (Org.). Obras poéticas.\r\nRio de Janeiro: Nova Aguilar, 1999 (fragmento).</small>\r\n\r\n<b>TEXTO II/b><br>\r\n\r\n<p>\r\nTudo aquilo que sei do mundo, mesmo por ciência, eu\r\no sei a partir de uma visão minha ou de uma experiência\r\ndo mundo sem a qual os símbolos da ciência não\r\npoderiam dizer nada.\r\n</p>\r\n\r\n<small>MERLEAU-PONTY, M. Fenomenologia da percepção. São Paulo:\r\nMartins Fontes, 1999 (adaptado).</small>\r\n\r\n<p>Os textos mostram-se alinhados a um entendimento\r\nacerca da ideia de conhecimento, numa perspectiva que\r\nampara a:/p>\r\n', '', 'Intermediária', 'anterioridade da razão no domínio cognitivo.', 'confirmação da existência de saberes inatos.', 'valorização do corpo na apreensão da realidade.', 'verificabilidade de proposições no campo da lógica.', ' possibilidade de contemplação de verdades atemporais.', 'c', 'Os textos abordam a percepção da realidade tendo por hase o corpo e as sensações. Fernando Pessoa, com seu heteronimo Alberto Caeiro por um viés mais panteista, e Merleau-Ponty, filósofo representante da fenomenologia, com alusão ao corpo inserto no mundo: \"sinto, logo existo!\"', '', 'Ciências Humanas', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(105, 53, '<p>\r\nO conjunto representado pelo agronegócio demanda condições específicas que passam a ser exigidas dos\r\nterritórios. Como há uma elevação da formação de fluxos, materiais e imateriais, a crescente articulação com as\r\nescalas que vão do local ao global terminam por pressionar o Estado a agir visando uma instalação no território\r\nde fixos diversos, bem como de uma regulação específica.\r\n</p>\r\n\r\n<small>LIMA, R. C.; PENNA, N. A. A logística de transportes do agronegócio em Mato Grosso (Brasil). Confins, n. 26, fev. 2016..</small>\r\n\r\n<p>O mapa e o texto se complementam indicando que a expansão das rodovias se deu como resposta ao(à):/p>\r\n', , 'Intermediária', ' alteração da matriz econômica.', ' substituição do modal hidroviário', 'retração do contingente demográfico.', ' projeção do escoamento produtivo.', ' estagnação de lavouras policultoras.', 'd', 'O mapa e o texto se complementam indicando que a expansão das rodovias se deu como resposta à projeção do escoamento produtivo do agronegócio, com destaque para o Centro-Oeste, com uma maior formação de fluxos e a crescente articulação com as escalas local e global.', '', 'Ciências Humanas', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(106, 53, '<p>\r\nUm dos resquícios franceses na dança são os comandos proferidos pelo marcador da quadrilha. Seu papel é\r\nanunciar os próximos passos da coreografia. O abrasileiramento de termos franceses deu origem, por exemplo, ao\r\nsaruê (soirée — reunião social noturna, ordem para todos se juntarem no centro do salão), anarriê (en arrière — para\r\ntrás) e anavã (en avant — para frente).\r\n</p>\r\n\r\n<small>Disponível em: www.ebc.com.br. Acesso em: 6 jul. 2015.</small>\r\n\r\n<p>A característica apresentada dessa manifestação popular resulta do seguinte processo socio-histórico:\r\n/p>\r\n', '', 'Intermediária', 'Massificação da arte erudita.', 'Rejeição de hábitos elitistas', 'Laicização dos rituais religiosos.', 'Restauração dos costumes antigos.', 'Apropriação de práticas estrangeiras.', 'e', 'A alternativa E refere-se à apropriação de práticas e termos estrangeiros inseridos no contexto brasileiro. demonstrando a existência de uma circulação de pessoas e costumes. Deve-se notar que a França exerceu grande influência cultural sobre o Brasil e o restante da América até o início do século XX.', '', 'Ciências Humanas', 3),
(107, 55, '<p>\r\nDois grandes eventos históricos tornaram possível\r\num caso como o de Menocchio: a invenção da imprensa\r\ne a Reforma. A imprensa lhe permitiu confrontar os\r\nlivros com a tradição oral em que havia crescido e lhe\r\nforneceu as palavras para organizar o amontoado de\r\nideias e fantasias que nele conviviam. A Reforma lhe\r\ndeu audácia para comunicar o que pensava ao padre do\r\nvilarejo, conterrâneos, inquisidores — mesmo não tendo\r\nconseguido dizer tudo diante do papa, dos cardeais e dos\r\npríncipes, como queria\r\n</p>\r\n\r\n<small>\r\nGINZBURG, C. O queijo e os vermes: o cotidiano e as ideias de um moleiro perseguido\r\npela Inquisição. São Paulo: Cia. das Letras, 2006.\r\n</small>\r\n\r\n<p>\r\nOs acontecimentos históricos citados ajudaram esse\r\nindivíduo, no século XVI, a repensar a visão católica do\r\nmundo ao possibilitarem a:\r\n/p>\r\n', '', 'Intermediária', 'consulta pública das bibliotecas reais.', 'sofisticação barroca do ritual litúrgico.', 'aceitação popular da educação secular.', 'interpretação autônoma dos textos bíblicos.', 'correção doutrinária das heresias medievais.', 'd', 'O aperfeiçoamento da imprensa de tipos móveis por Gutemberg no século XV, facilitou a disseminação de novas ideias, inclusive de críticas a algumas práticas e interpretações da Igreja Católica. A Reforma, iniciada por Lutero em 1517, apregoou o livre-exame de textos bíblicos valendo-se também da expansão da imprensa. A Bíblia traduzida para o alemão diferente da versão católica em latim - alcançou um grande público e contribuiu para abalar a hegemonia cultural e religiosa da Santa Sé.', '', 'Ciências Humanas', 3),
(108, 56, '<p>Devo estar chegando perto do centro da Terra. Deixe ver: deve ter sido mais de seis mil quilômetros, por aí...\r\n(como se vê, Alice tinha aprendido uma porção de coisas desse tipo na escola, e embora essa não fosse uma oportunidade lá muito boa de demonstrar conhecimentos, já que não havia ninguém por perto para escutá-la, em todo caso era bom praticar um pouco)</p>\r\n sim, deve ser mais ou menos essa a distância... mas então qual seria a latitude ou longitude em que estou?</p>\r\n(Alice não tinha a menor ideia do que fosse latitude ou longitude, mas achou que eram palavras muito imponentes).</p>\r\n\r\n<small>CARROLL, L. Aventuras de Alice: no País das Maravilhas, Através do espelho e outros textos. São Paulo: Summus, 1980.</small>\r\n<p>O texto descreve uma confusão da personagem em\r\nrelação</p<', '', 'Intermediária', ' ao tipo de projeção cartográfica.', ' aos contornos dos fusos horários.', ' à localização do norte magnético.', 'aos referenciais de posição relativa.', 'às distorções das formas continentais.', 'd', 'A imprecisão descrita no texto mostra que a personagem não tem a noção exata de sua distância e de sua profundidade do interior do planeta. Isso é possível observar quando mostra as dificuldades de identificar a localização e a distância relativa do percurso realizado no excerto apresentado. No texto, não há menção confusa quanto à projeção cartográfica de algum mapeamento elaborado; dificuldade de compreensão das horas no deslocamento; não identificação do norte magnético; e das disformidades provocadas nas formas continentais geológicas ou cartográficas.', '', 'Ciências Humanas', 3),
(109, 57, '<p>A arte pré-histórica africana foi incontestavelmente um\r\nveículo de mensagens pedagógicas e sociais. Os San,\r\nque constituem hoje o povo mais próximo da realidade\r\ndas representações rupestres, afirmam que seus\r\nantepassados lhes explicaram sua visão do mundo a partir\r\ndesse gigantesco livro de imagens que são as galerias.\r\nA educação dos povos que desconhecem a escrita está\r\nbaseada sobretudo na imagem e no som, no audiovisual.</p>\r\n\r\n<small>\r\nKI-ZERBO, J. A arte pré-histórica africana. In: KI-ZERBO, J. (Org.)\r\nHistória geral da África, I: metodologia e pré-história da África.\r\nBrasília: Unesco, 2010.\r\n</small>\r\n\r\n<p>\r\nDe acordo com o texto, a arte mencionada é importante\r\npara os povos que a cultivam por colaborar para o(a):\r\n</p>', '', 'Intermediária', 'transmissão dos saberes acumulados', 'expansão da propriedade individual.', 'ruptura da disciplina hierárquica.', 'surgimento dos laços familiares.', 'rejeição de práticas exógenas.', 'a', 'A alternativa A retoma o texto ao privilegiar as imagens como transmissoras de mensagens peda- gógicas e sociais. Muitos povos ágrafos (sem escrita) transmitiram elementos de sua cultura utilizando a arte rupestre com desenhos em paredes rochosas, evidenciando a função dessas representações.', '', 'Ciências Humanas', 3),
(110, 58, '<p>\r\nA alternativa A retoma o texto ao privilegiar as imagens como transmissoras de mensagens peda- gógicas e sociais. Muitos povos ágrafos (sem escrita) transmitiram elementos de sua cultura utilizando a arte rupestre com desenhos em paredes rochosas, evidenciando a função dessas representações.\r\n</p>\r\n\r\n<small>\r\nNAGEL, T. Uma breve introdução à filosofia. São Paulo: Martins Fontes, 2011.\r\n</small>\r\n\r\n<p>\r\nO texto confere visibilidade a uma doutrina filosófica\r\ncontemporânea conhecida como:\r\n</p>', '', 'Intermediária', 'Personalismo, que vincula a realidade circundante aos domínios do pessoal.', 'Falsificacionismo, que estabelece ciclos de problemas para refutar uma conjectura.', 'Falibilismo, que rejeita mecanismos mentais para sustentar uma crença inequívoca.', 'Idealismo, que nega a existência de objetos independentemente do trabalho cognoscente.', 'Solipsismo, que reconhece limitações cognitivas para compreender uma experiência compartilhada.', 'e', 'O texto refere-se ao conceito de solipsismo, segundo o qual nada existe fora da experiência e da construção mental do indivíduo. Essa doutrina chega, inclusive, a negar a existência do próprio mundo.', '', 'Ciências Humanas', 3),
(111, 59, '<p>\r\nA expansão das cidades e a formação das aglomerações urbanas no Brasil foram marcadas pela produção\r\nindustrial e pela consolidação das metrópoles como locais de seu desenvolvimento. Na segunda metade do século XX,\r\nas metrópoles brasileiras estenderam-se por áreas de ocupação contínua, configurando densas regiões urbanizadas\r\n</p>\r\n\r\n<small>\r\nMOURA, R. Arranjos urbano-regionais no Brasil: especificidades e reprodução de padrões. Disponível em: www.ub.edu. Acesso em: 11 fev. 2015.\r\n</small>\r\n\r\n<p>\r\nO resultado do processo geográfico descrito foi o(a):\r\n</p>', '', 'Intermediária', 'valorização da escala local.', 'crescimento das áreas periféricas.', 'densificação do transporte ferroviário.', 'predomínio do planejamento estadual.', 'inibição de consórcios intermunicipais.', 'b', 'O crescimento das cidades brasileiras, a partir de meados do século XX, provocou a metropolização dos grandes espaços urbanos. Porém, a urbanização do Brasil foi marcada pela segregação socioespacial que levou à expansão das cidades para as áreas periféricas.', '', 'Ciências Humanas', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(112, 60, '<p>\r\nA dinâmica produtiva apresentada na imagem tem como estratégia central a :\r\n</p>', , 'Intermediária', 'separação pelo tipo de solo', 'exportação da colheita sazonal.', ' priorização da tecnologia moderna.', 'adequação pelo tempo da natureza', 'intensificação da atividade pecuária.', 'd', 'O diagrama, que mostra o uso do solo, com pastoreio, cultura de algodão e cereais no Agreste, evidencia que no mesmo solo, as diversas culturas executadas ao longo do ano adequam-se às situações impostas pela natureza (clima, ambiente etc.). Não há predomínio de uma única atividade e a região do Agreste não se caracteriza pelas exportações.', '', 'Ciências Humanas', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(113, 61, '<p>\r\nO Rio Tietê está morto. Ao menos uma parte\r\ndele: 137 quilômetros, para ser mais preciso. Uma\r\npesquisa da Fundação SOS Mata Atlântica mostra\r\nque, em 2016, o trecho do rio com qualidade de\r\nágua classificada como ruim ou péssima começa\r\nem Itaquaquecetuba, passa por toda a Região\r\nMetropolitana de São Paulo e chega até Cabreúva,\r\njá no interior de São Paulo. Nesse trecho, a água não\r\ntem oxigênio suficiente para abrigar vida.\r\n</p>\r\n\r\n<small>\r\nDisponível em: http://epoca.globo.com. Acesso em: 7 dez. 2017 (adaptado).\r\n</small>\r\n\r\n<p>\r\nConsiderando a análise dos textos, a condição atual\r\ndesse rio tem como origem a:\r\n</p>', , 'Intermediária', 'valorização do sítio urbano.', 'extinção da vegetação nativa. ', ' recepção de densa carga de dejetos.', ' captação desordenada do regime pluvial.', 'expansão do uso de defensivos químicos.', 'c', 'Sabe-se que a Região Metropolitana de São Paulo despeja boa parte de seus efluentes, com baixo indice de tratamento, diretamente no Rio Tietê. Essa carga de dejetos é de origem principalmente urbana e, dado seu grande volume, apresenta dificuldades em se diluir nas águas do rio. Poluição com defensivos químicos ocorre mais intensamente em áreas rurais, o que não é o caso da região metropolitana, e fatos como a extinção da vegetação nativa e captação de águas pluviais não têm relação direta com a poluição', '', 'Ciências Humanas', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(114, 62, '<p>\r\nAdão, ainda que supuséssemos que suas faculdades\r\nracionais fossem inteiramente perfeitas desde o início,\r\nnão poderia ter inferido da fluidez e transparência da\r\nágua que ela o sufocaria, nem da luminosidade e calor\r\ndo fogo que este poderia consumi-lo. Nenhum objeto\r\njamais revela, pelas qualidades que aparecem aos\r\nsentidos, nem as causas que o produziram, nem os\r\nefeitos que dele provirão; e tampouco nossa razão é\r\ncapaz de extrair, sem auxílio da experiência, qualquer\r\nconclusão referente à existência efetiva de coisas ou\r\nquestões de fato.\r\n</p>\r\n\r\n<small>\r\nHUME, D. Uma investigação sobre o entendimento humano. São Paulo: Unesp, 2003.\r\n</small>\r\n\r\n<p>\r\nSegundo o autor, qual é a origem do conhecimento\r\nhumano?\r\n</p>', '', 'Intermediária', 'A potência inata da mente. ', 'A revelação da inspiração divina.', 'O estudo das tradições filosóficas.', ' A vivência dos fenômenos do mundo.', 'O desenvolvimento do raciocínio abstrato', 'd', 'De acordo com David Hume, a origem do conheci mento é procedente a partir do contato com os fenômenos analisados, isto é, indo além da ideia do inatismo ou até mesmo do referencial de verdade absoluta. A experiência conduz o saber além das impressões superficiais, que causariam meras ideias incompletas. Hume estrutura a base empírica por meio de uma tônica mais cética, distante do inatismo, da revelação divina, das tradições ou do abstracionismo.', '', 'Ciências Humanas', 3),
(115, 63, '<b>TEXTO I</b>\r\n<p>\r\nO aumento de casos suspeitos de febre amarela em\r\nMinas pode estar relacionado à tragédia de Mariana,\r\nem 2015, segundo a bióloga da Fiocruz Márcia Chame.\r\nA hipótese tem como ponto de partida a localização das\r\ncidades mineiras que identificaram até o momento casos\r\nde pacientes com sintomas da doença. Grande parte está\r\nna região próxima do Rio Doce, afetado pelo rompimento\r\nda Barragem de Fundão, em novembro de 2015. \r\n</p>\r\n\r\n<small>\r\nFORMENTI, L. Para bióloga, surto de febre amarela pode ter relação com tragédia de\r\nMariana. O Estado de São Paulo, 14 jan. 2017.\r\n</small>\r\n\r\n<b>TEXTO Ii</b>\r\n<p>\r\nPor outro lado, Servio Ribeiro considera remota a\r\npossibilidade de influência da tragédia de Mariana (MG)\r\nneste surto de febre amarela em Minas Gerais. “A febre\r\namarela é uma doença de interior de floresta. O mosquito\r\nque a transmite põe ovos em cavidades de árvores e em\r\nbromélias. É um mosquito da estrutura da floresta. Ele\r\nnão se relaciona muito com grandes corpos-d’água e\r\ncom rios. As cidades afetadas pela doença estão em uma\r\nregião onde os rejeitos não chegaram com força para\r\nderrubar a floresta”, diz o biólogo\r\n</p>\r\n\r\n<small>RODRIGUES, L. Especialistas investigam relação entre febre amarela e degradação\r\nambiental. Agência Brasil, 25 jan. 2017.</small>\r\n\r\n<p>Sobre a tragédia de Mariana, os textos apresentam\r\ndivergência quanto ao(à):</p>', '', 'Intermediária', 'poluição dos rios locais.', ' identificação da área afetada.', 'destruição da vegetação nativa.', 'aparecimento de enfermidade endêmica', 'surgimento de comunidades desabrigadas.', 'd', 'As ideias apresentadas nos textos aparentemente - sugerem uma divergência no entendimento acerca de uma endemia a febre amarela na região afetada pela tragédia de Mariana. Sabe-se que uma doença endemica vitima uma população de espaço geográfico específico; no caso da febre amarela, trata-se de doença infecciosa, causada por um arbovirus-virus transmitidos por mosquitos - que são característicos de áreas de florestas e matas tropicais.', '', 'Ciências Humanas', 3),
(116, 64, '<p>\r\nA Divisão Internacional do Trabalho significa\r\nque alguns países se especializam em ganhar\r\ne outros, em perder. Nossa comarca no mundo,\r\nque hoje chamamos América Latina, foi precoce:\r\nespecializou-se em perder desde os remotos\r\ntempos em que os europeus do Renascimento se\r\naventuraram pelos mares e lhe cravaram os dentes\r\nna garganta. Passaram-se os séculos e a América\r\nLatina aprimorou suas funções.\r\n</p>\r\n\r\n<small>\r\nGALEANO, E. As veias abertas da América Latina. São Paulo: Paz e Terra, 1978.\r\n</small>\r\n\r\n\r\n<p>Escrito na década de 1970, o texto considera a\r\nparticipação da América Latina na Divisão Internacional\r\ndo Trabalho marcada pela:</p>', '', 'Intermediária', 'produção inovadora de padrões de tecnologia.', 'superação paulatina do caráter agroexportador', 'apropriação imperialista dos recursos territoriais', 'valorização econômica dos saberes tradicionais.', ' dependência externa do suprimento de alimentos.', 'c', 'O texto clássico do escrito Eduardo Galeano considera que a inserção periférica da América Latina na DIT, Divisão Internacional do Trabalho, foi marcada pela espoliação de seus recursos territoriais minérios. recursos hídricos, energéticos e vegetais, solos etc. -pelas potências coloniais, a favor de suas necessidades imperiais e em desfavor, em prejuízo, da população latino-americana.', '', 'Ciências Humanas', 3),
(117, 65, '<p>\r\nSexto rei sumério (governante entre os séculos XVIII e\r\nXVII a.C.) e nascido em Babel, “Khammu-rabi” (pronúncia\r\nem babilônio) foi fundador do I Império Babilônico\r\n(correspondente ao atual Iraque), unificando amplamente\r\no mundo mesopotâmico, unindo os semitas e os sumérios\r\ne levando a Babilônia ao máximo esplendor. O nome\r\nde Hamurabi permanece indissociavelmente ligado ao\r\ncódigo jurídico tido como o mais remoto já descoberto: o\r\nCódigo de Hamurabi. O legislador babilônico consolidou\r\na tradição jurídica, harmonizou os costumes e estendeu o\r\ndireito e a lei a todos os súditos.\r\n</p>\r\n\r\n<small>\r\nDisponível em: www.direitoshumanos.usp.br. Acesso em: 12 fev. 2013 (adaptado).\r\n</small>\r\n\r\n\r\n<p>Nesse contexto de organização da vida social, as leis\r\ncontidas no Código citado tinham o sentido de:</p>', '', 'Intermediária', 'assegurar garantias individuais aos cidadãos livres.', ' tipificar regras referentes aos atos dignos de punição', 'conceder benefícios de indulto aos prisioneiros de guerra.', ' promover distribuição de terras aos desempregados urbanos.', ' conferir prerrogativas políticas aos descendentes de estrangeiros.', 'b', 'O Código de Hamurabi estabeleceu o princípio da reciprocidade, no caso de o autor e a vitima pertencerem ao mesmo estamento. Esse princípio é semelhante à Lei de Talião romana e à norma biblica do \"olho por olho, dente por dente\".\r\nSeu objetivo central era garantir regras para a comunidade, controlando as relações sociais com duras punições aos transgressores.', '', 'Ciências Humanas', 3),
(118, 66, '<p>\r\nDesde o mundo antigo e sua filosofia, que o trabalho\r\ntem sido compreendido como expressão de vida e\r\ndegradação, criação e infelicidade, atividade vital e\r\nescravidão, felicidade social e servidão. Trabalho e\r\nfadiga. Na Modernidade, sob o comando do mundo da\r\nmercadoria e do dinheiro, a prevalência do negócio (negar\r\no ócio) veio sepultar o império do repouso, da folga e da\r\npreguiça, criando uma ética positiva do trabalho.\r\n</p>\r\n\r\n<small>\r\nANTUNES, R. O século XX e a era da degradação do trabalho. In: SILVA, J. P. (Org.).\r\nPor uma sociologia do século XX. São Paulo: Annablume, 2007 (adaptado).\r\n</small>\r\n\r\n\r\n<p>O processo de ressignificação do trabalho nas sociedades\r\nmodernas teve início a partir do surgimento de uma nova\r\nmentalidade, influenciada pela:</p>', '', 'Intermediária', 'reforma higienista, que combateu o caráter excessivo e insalubre do trabalho fabril.', ' Reforma Protestante, que expressou a importância das atividades laborais no mundo secularizado.', 'força do sindicalismo, que emergiu no esteio do anarquismo reivindicando direitos trabalhistas.', 'participação das mulheres em movimentos sociais, defendendo o direito ao trabalho', 'visão do catolicismo, que, desde a Idade Média, defendia a dignidade do trabalho e do lucro', 'b', 'A questão faz referência ao conceito de trabalho segundo a ética protestante, segundo a qual o trabalho é agradável a Deus, o que possibilitou um processo de acúmulo de capital e o advento do mundo moderno e secularizado.', '', 'Ciências Humanas', 3),
(119, 67, '<p>\r\nÉ difícil imaginar que nos anos 1990, num país\r\ncom setores da população na pobreza absoluta e sem\r\numa rede de benefícios sociais em que se apoiar, um\r\ngoverno possa abandonar o papel de promotor de\r\nprogramas de geração de emprego, de assistência\r\nsocial, de desenvolvimento da infraestrutura e de\r\npromoção de regiões excluídas, na expectativa de\r\nque o mercado venha algum dia a dar uma resposta\r\nadequada a tudo isso.\r\n</p>\r\n\r\n<small>\r\nSORJ, B. A nova sociedade brasileira. Rio de Janeiro: Jorge Zahar, 2000 (adaptado).\r\n</small>\r\n\r\n\r\n<p>Nesse contexto, a criticada postura dos governos frente\r\nà situação social do país coincidiu com a priorização de\r\nque medidas?</p>', '', 'Intermediária', ' Expansão dos investimentos nas empresas públicas e nos bancos estatais.', 'Democratização do crédito habitacional e da aquisição de moradias populares.', 'Enxugamento da carga fiscal individual e da contribuição tributária empresarial.', 'Reformulação do acesso ao ensino superior e do financiamento científico nacional.', ' Reforma das políticas macroeconômicas e dos mecanismos de controle inflacionário.', 'e', 'Durante a década de 1990, o governo brasileiro realizou importantes reformas macroeconomicas, especialmente relacionadas ao controle inflacionário. bem como medidas voltadas ao combate ao déficit público. Tais medidas foram priorizadas pelo governo e se faziam necessárias para conter a crise económica vivida pelo Brasil ao longo da década de 1980. Trata- se ainda de um período caracterizado pela adoção de medidas econômicas desestatizantes, resultando na diminuição da participação do Estado na promoção de políticas sociais, e pela privatização de empresas públicas e bancos estatais.', '', 'Ciências Humanas', 3),
(120, 68, '<p>\r\nEmbora inegáveis os benefícios que ambas as\r\neconomias têm auferido do intercâmbio comercial, o Brasil\r\ntem reiterado seu objetivo de desenvolver com a China\r\numa relação comercial menos assimétrica. Os números\r\nrevelam com clareza a assimetria. As exportações\r\nbrasileiras de produtos básicos, especialmente soja,\r\nminério de ferro e petróleo, compõem, dependendo do\r\nano, algo entre 75% e 80% da pauta, ao passo que as\r\nimportações brasileiras consistem, aproximadamente,\r\nem 95% de produtos industrializados chineses, que vão\r\ndesde os mais variados bens de consumo até máquinas\r\ne equipamentos de alto valor.\r\n</p>\r\n\r\n<small>\r\nLEÃO, V. C. Prefácio. In: CINTRA, M. A. M.; SILVA FILHO, E. B.; PINTO, E. C. (Org.).\r\nChina em transformação: dimensões econômicas e geopolíticas do desenvolvimento.\r\nRio de Janeiro: Ipea, 2015.\r\n</small>\r\n\r\n\r\n<p>\r\nUma ação estatal de longo prazo capaz de reduzir a\r\nassimetria na balança comercial brasileira, conforme\r\nexposto no texto, é o(a):\r\n</p>', '', 'Intermediária', 'expansão do setor extrativista.', ' incremento da atividade agrícola.', 'diversificação da matriz energética', 'fortalecimento da pesquisa científica.', 'monitoramento do fluxo alfandegário.', 'd', 'O texto destaca a assimetria na balança comercial entre Brasil e China, já que o Brasil exporta, predominantemente, produtos básicos, mas importa, majoritariamente, produtos industrializados. Uma ação que poderia reduzir tal assimetria é o fomento à pesquisa cientifica, e uma politica de desenvolvimento industrial, podendo agregar maior valor as exportações do País. As alternativas a e b estão incorretas, porque tratam. respectivamente, da expansão do extrativismo e da atividade agrícola, que gerariam a exportação de ainda mais produtos primários pelo Brasil e acentuariam a assimetria. Já a diversificação da matriz energética e o monitoramento do fluxo alfandegário, citados nas alternativas c e e, respectivamente, por si só, não contribuem para reduzir a citada assimetria.', '', 'Ciências Humanas', 3),
(121, 69, '<p>\r\nAs estatísticas mais recentes do Brasil rural revelam\r\num paradoxo que interessa a toda sociedade: o emprego\r\nde natureza agrícola definha em praticamente todo o país,\r\nmas a população residente no campo voltou a crescer; ou\r\npelo menos parou de cair. Esses sinais trocados sugerem\r\nque a dinâmica agrícola, embora fundamental, já não\r\ndetermina sozinha os rumos da demografia no campo.\r\nEsse novo cenário é explicado em parte pelo incremento\r\ndo emprego não agrícola no campo. Ao mesmo tempo,\r\naumentou a massa de desempregados, inativos e\r\naposentados que mantêm residência rural.\r\n</p>\r\n\r\n<small>\r\nSILVA, J. G. Velhos e novos mitos do rural brasileiro. Estudos Avançados, n. 43, dez. 2001.\r\n</small>\r\n\r\n\r\n<p>\r\nSobre o espaço brasileiro, o texto apresenta argumentos\r\nque refletem a:\r\n</p>', '', 'Intermediária', 'heterogeneidade do modo de vida agrário.', 'redução do fluxo populacional nas cidades.', 'correlação entre força de trabalho e migração sazonal.', 'indissociabilidade entre local de moradia e acesso à renda.', 'desregulamentação das propriedades nas zonas de fronteira.', 'd', 'A mecanização e a modernização no campo brasileiro provocaram nas últimas décadas intenso êxodo rural, representando importante fator que colaborou com o crescimento da população urbana no País. A redução la oferta de trabalho em atividades agropecuárias tem levado ao crescimento de outras atividades, como o  turismo rural, o ecoturismo, a agroindústria e o extrativismo, o que torna atualmente o modo de vida no campo mais heterogeneo.', '', 'Ciências Humanas', 3),
(122, 70, '<p>\r\nNas últimas décadas, uma acentuada feminização\r\nno mundo do trabalho vem ocorrendo. Se a participação\r\nmasculina pouco cresceu no período pós-1970, a\r\nintensificação da inserção das mulheres foi o traço\r\nmarcante. Entretanto, essa presença feminina se dá mais\r\nno espaço dos empregos precários, onde a exploração,\r\nem grande medida, se encontra mais acentuada.\r\n</p>\r\n\r\n<small>\r\nNOGUEIRA, C. M. As trabalhadoras do telemarketing: uma nova divisão sexual do trabalho?\r\nIn: ANTUNES, R. et al. Infoproletários: degradação real do trabalho virtual.\r\nSão Paulo: Boitempo, 2009.\r\n</small>\r\n\r\n\r\n<p>\r\nA transformação descrita no texto tem sido insuficiente\r\npara o estabelecimento de uma condição de igualdade de\r\noportunidade em virtude da(s):\r\n</p>', '', 'Intermediária', ' estagnação de direitos adquiridos e do anacronismo da legislação vigente.', 'manutenção do status quo gerencial e dos padrões de socialização familiar.', 'desestruturação da herança patriarcal e das mudanças do perfil ocupacional.', 'disputas na composição sindical e da presença na esfera político-partidária.', 'exigências de aperfeiçoamento profissional e de habilidades na competência diretiva.', 'b', 'Nos moldes tradicionais, ainda muito presentes, a mulher e o seu papel na sociedade moderna, apesar das muitas conquistas políticas, continua desvalorizada, com restrita expressão social. Esse desvalor é reproduzido no mercado de trabalho. sobretudo, com as evidentes diferenças salariais entre homens e mulheres.', '', 'Ciências Humanas', 3),
(123, 71, '<p>\r\nA propriedade compreende, em seu conteúdo e alcance,\r\nalém do tradicional direito de uso, gozo e disposição por\r\nparte de seu titular, a obrigatoriedade do atendimento de\r\nsua função social, cuja definição é inseparável do requisito\r\nobrigatório do uso racional da propriedade e dos recursos\r\nambientais que lhe são integrantes. O proprietário, como\r\nmembro integrante da comunidade, se sujeita a obrigações\r\ncrescentes que, ultrapassando os limites do direito de\r\nvizinhança, no âmbito do direito privado, abrangem o campo\r\ndos direitos da coletividade, visando o bem-estar geral, no\r\nâmbito do direito público.\r\n</p>\r\n\r\n<small>\r\nJELINEK, R. O princípio da função social da propriedade e sua repercussão sobre o\r\nsistema do Código Civil. Disponível em: www.mp.rs.gov.br. Acesso em: 20 fev. 2013\r\n</small>\r\n\r\n\r\n<p>\r\nOs movimentos em prol da reforma agrária, que\r\natuam com base no conceito de direito à propriedade\r\napresentado no texto, propõem-se a:\r\n</p>', '', 'Intermediária', 'reverter o processo de privatização fundiária.', ' ressaltar a inviabilidade da produção latifundiária.', 'defender a desapropriação dos espaços improdutivos.', ' impedir a produção exportadora nas terras agricultáveis.', 'coibir o funcionamento de empresas agroindustriais no campo.', 'c', 'A reforma agrária compreende a reorganização da estrutura fundiária, a partir da redistribuição das terras agrícolas consideradas improdutivas, de modo que possam realizar sua função social, fazendo diminuir a concentração fundiária e a injustiça social. Não se trata de reverter o processo de privatização das terras, mas sim de desapropriar espaços agrários improdutivos e dividi-los para posterior assentamento, possiblitando o acesso de trabalhadores rurais sem terra.', '', 'Ciências Humanas', 3),
(124, 72, '<p>\r\nAfirmar que a cartografia da época moderna integrou o\r\nprocesso de invenção da América por parte dos europeus\r\nsignifica que os conhecimentos dos ameríndios sobre o\r\nterritório foram ignorados pela cartografia europeia ou que\r\neles foram privados de sua representação territorial e da\r\nautoridade que seus conhecimentos tinham sobre o espaço\r\n</p>\r\n\r\n<small>\r\nautoridade que seus conhecimentos tinham sobre o espaço.\r\nOLIVEIRA, T. K. Desconstruindo mapas, revelando espacializações: reflexões sobre o uso\r\nda cartografia em estudos sobre o Brasil colonial. Revista Brasileira de História,\r\nn. 68, 2014 (adaptado)\r\n</small>\r\n\r\n\r\n<p>\r\nNa análise contida no texto, a representação cartográfica\r\nda América foi marcada por:\r\n</p>', '', 'Intermediária', 'asserção da cultura dos nativos', 'avanço dos estudos do ambiente.', 'avanço dos estudos do ambiente.', 'exatidão da demarcação das regiões.', 'aprimoramento do conceito de fronteira', 'c', 'A reforma agrária compreende a reorganização da estrutura fundiária, a partir da redistribuição das terras agrícolas consideradas improdutivas, de modo que possam realizar sua função social, fazendo diminuir a concentração fundiária e a injustiça social. Não se trata de reverter o processo de privatização das terras, mas sim de desapropriar espaços agrários improdutivos e dividi-los para posterior assentamento, possiblitando o acesso de trabalhadores rurais sem terra.', '', 'Ciências Humanas', 3),
(125, 73, '<p>\r\n“A principal característica da situação social dos\r\nanglo-americanos é seu caráter eminentemente demo -\r\ncrático. Afirmei anteriormente que reinava uma igualdade\r\nmuito grande entre os emigrantes que foram se\r\nestabelecer na Nova Inglaterra. Para isso contribuiu a\r\ninfluência das leis de sucessão. Estabelecidas de uma\r\nmaneira, as leis de sucessão reúnem, concentram e\r\nagrupam em um só a propriedade e o poder. Estabelecidas\r\npor outros princípios, produzem o oposto: dividem,\r\npartilham e disseminam os bens e o poder.”\r\n</p>\r\n\r\n<small>\r\n(TOCQUEVILLE, A. A democracia na América.\r\nBelo Horizonte: Itatiaia; São Paulo: Edusp, 1977. Adaptado.)\r\n</small>\r\n\r\n\r\n<p>\r\nO texto tematiza o papel desempenhado por uma norma\r\nna criação de um ambiente propício ao(à):\r\n</p>', '', 'Intermediária', 'emprego do trabalho escravo.', ' consolidação dos valores burgueses.', 'banimento das dissidências religiosas.', 'contenção da identificação nacionalista', 'hierarquização dos agentes econômicos.', 'b', 'A colonização da Nova Inglaterra estabeleceu princípios voltados ao desenvolvimento autossustentado e caracterizado por práticas capitalistas de valores burgueses, dentro da formação de uma nova pátria aos refugiados protestantes, de formação calvinista. No caso, o autor associa a propriedade ao exercício do poder, tornando-o mais bem distribuído. ', '', 'Ciências Humanas', 3),
(126, 74, '<p>\r\nVemos que toda cidade é uma espécie de comunidade, e\r\ntoda comunidade se forma com vistas a algum bem, pois\r\ntodas as ações de todos os homens são praticadas com\r\nvistas ao que lhe parece um bem; se todas as comunidades\r\nvisam algum bem, é evidente que a mais importante de\r\ntodas elas e que inclui todas as outras tem mais que todas\r\neste objetivo e visa ao mais importante de todos os bens.\r\n</p>\r\n\r\n<small>\r\nARISTÓTELES Política. Brasília: UnB,1988.\r\n</small>\r\n\r\n\r\n<p>\r\nNo fragmento, Aristóteles promove uma reflexão que\r\nassocia dois elementos essenciais à discussão sobre a vida\r\nem comunidade, a saber:\r\n</p>', '', 'Intermediária', 'Ética e política, pois conduzem à eudaimonia.', ' Retórica e linguagem, pois cuidam dos discursos na ágora.', ' Metafísica e ontologia, pois tratam da filosofia primeira', 'Democracia e sociedade, pois se referem a relações sociais.', 'Geração e corrupção, pois abarcam o campo da physis.', 'a', 'Para Aristóteles as bases que norteiam o sentido da felicidade (“eudaimonia”) são ações que visam ao equilíbrio da comunidade (ética), de modo a ter como grande finalidade o bem comum no ato político. As duas características, o ato ético e a composição política, são as bases textuais.', '', 'Ciências Humanas', 3),
(127, 75, '<p>\r\n“O toyotismo, a partir dos anos 1970, teve grande\r\nimpacto no mundo ocidental, quando se mostrou para os\r\npaíses avançados como uma opção possível para a\r\nsuperação de uma crise de acumulação.”\r\n</p>\r\n\r\n<small>\r\n(ANTUNES, R. Os sentidos do trabalho: ensaio sobre a afirmação\r\ne a negação do trabalho. São Paulo: Boitempo. 2009. Adaptado.)\r\n</small>\r\n\r\n\r\n<p>\r\nA característica organizacional do modelo em questão,\r\nrequerida no contexto de crise, foi o(a)\r\n</p>', '', 'Intermediária', ' expansão dos grandes estoques.', 'incremento da fabricação em massa.', 'adequação da produção à demanda.', 'aumento da mecanização do trabalho.', 'centralização das etapas de planejamento', 'c', 'O toyotismo ficou conhecido a partir da década de 1970 e tem como uma de suas características a produção baseada na demanda, minimizando assim os custos de produção das empresas com a eliminação ou diminuição ao máximo dos estoques.', '', 'Ciências Humanas', 3),
(128, 76, '<p>\r\n“O fenômeno histórico conhecido como “tráfico de\r\ncoolies” esteve associado diretamente ao período que vai\r\ndo final da década de 1840 até o ano de 1874, quando\r\nmilhares de chineses foram encaminhados principalmente\r\npara Cuba e Peru e muitos abusos no recrutamento de\r\nmão de obra foram identificados. O tráfico de coolies ou,\r\nem outros termos, o transporte por meios coativos de mão\r\nde obra de um lugar para outro, foi comparado ao tráfico\r\nafricano de escravos por muitos periodistas e analistas do\r\nséculo XIX.”\r\n</p>\r\n\r\n<small>\r\n(SANTOS, M. A. Migrações e trabalho sob contrato no século XIX.\r\nHistória. n. 12, 2017.)\r\n</small>\r\n\r\n\r\n<p>\r\nA comparação mencionada no texto foi possível em razão\r\nda seguinte característica:\r\n</p>', '', 'Intermediária', 'Oferta de contrato formal.', 'Origem étnica dos grupos de trabalhadores.', 'Conhecimento das tarefas desenvolvidas.', 'Controle opressivo das vidas dos indivíduos.', 'Investimento requerido dos empregadores', 'd', 'Os coolies foram trabalhadores braçais asiáticos trazidos para diversas partes da América ao longo do século XIX. Embora juridicamente não fossem propriedade de seus empregadores, há diversos relatos de maus-tratos e impedimentos a suas liberdades individuais, além de, como refere o texto, abusos no aliciamento dos trabalhadores. ', '', 'Ciências Humanas', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(129, 77, '<p>\r\nOs aspectos físicos apresentados originam-se da atuação\r\nda força natural de:\r\n</p>\r\n\r\n<small>\r\n(SANTOS, M. A. Migrações e trabalho sob contrato no século XIX.\r\nHistória. n. 12, 2017.)\r\n</small>\r\n\r\n\r\n<p>\r\nA comparação mencionada no texto foi possível em razão\r\nda seguinte característica:\r\n</p>', , 'Fácil', 'colisão de placas tectônicas.', 'rifteamento da crosta terrestre.', 'subducção da plataforma oceânica.', 'formação de cadeias montanhosas.', 'metamorfismo de bordas continentais.', 'b', 'O processo de rifteamento ocorre como consequência da movimentação intraplaca, com a separação de formações rochosas de elevada densidade. Esse fenômeno se apresenta de forma relativamente alinhada com a configuração tectônica e pode ter como repercussão a formação de lagos e fossas tectônicas.', '', 'Ciências Humanas', 3);
INSERT INTO `questao` (`idquest`, `numero`, `texto`, `img`, `dificuldade`, `alternativaA`, `alternativaB`, `alternativaC`, `alternativaD`, `alternativaE`, `respCorreta`, `textoResposta`, `linkCorrecao`, `disciplina`, `enem`) VALUES
(130, 78, '<p>\r\n“A reabilitação da biografia histórica integrou as\r\naquisições da história social e cultural, oferecendo aos\r\ndiferentes atores históricos uma importância diferenciada,\r\ndistinta, individual. Mas não se tratava mais de fazer,\r\nsimplesmente, a história dos grandes nomes, em formato\r\nhagiográfico – quase uma vida de santo –, sem problemas,\r\nnem máculas. Mas de examinar os atores (ou o ator)\r\ncélebres ou não, como testemunhas, como reflexos, como\r\nreveladores de uma época.”\r\n</p>\r\n\r\n<small>\r\n(DEL PRIORE, M Biografia: quando o indivíduo encontra a\r\nhistória. Topoi, n. 19. jul-dez 2009.)\r\n</small>\r\n\r\n\r\n<p>\r\nDe acordo com o texto, novos estudos têm valorizado a\r\nhistória do indivíduo por se constituir como possibi -\r\nlidade de:\r\n</p>', '', 'Intermediária', ' adesão ao método positivista.', 'expressão do papel das elites.', ' resgate das narrativas heroicas.', 'acesso ao cotidiano das comunidades.', 'interpretação das manifestações do divino.', 'd', 'O processo de rifteamento ocorre como consequência da movimentação intraplaca, com a separação de formações rochosas de elevada densidade. Esse fenômeno se apresenta de forma relativamente alinhada com a configuração tectônica e pode ter como repercussão a formação de lagos e fossas tectônicas.', '', 'Ciências Humanas', 3),
(131, 79, '<p>\r\n“A sociedade como um sistema justo de cooperação\r\nsocial consiste em uma das ideias familiares\r\nfundamentais, que dá estrutura e organização à justiça\r\ncomo equidade. A cooperação social guia-se por regras e\r\nprocedimentos publicamente reconhecidos e aceitos por\r\naqueles que cooperam como sendo apropriados para\r\nregular a sua conduta. Diz-se que a cooperação é justa\r\nporque seus termos são tais que todos os participantes\r\npodem razoavelmente aceitar, desde que todos os demais\r\ntambém o aceitem.”\r\n</p>\r\n\r\n<small>\r\n(FERES JR. J.: POGREBINSCHI, T. Teoria política\r\ncontemporânea: uma introdução. Rio de Janeiro: Elsevier. 2010.)\r\n</small>\r\n\r\n\r\n<p>\r\nNo contexto do pensamento político, a ideia apresentada\r\nmostra-se consoante o(a):\r\n</p>', '', 'Intermediária', 'ideal republicano de governo.', 'corrente tripartite dos poderes.', 'posicionamento crítico do socialismo.', 'legitimidade do absolutismo monárquico', 'entendimento do contratualismo moderno.', 'e', 'O texto trabalha a ideia de cooperação como elemento fundamental de uma organização política em que haja a participação de todos os indivíduos no processo. Tal reflexão remete ao pensamento iluminista – especialmente tal como expresso em O Contrato Social, de Rousseau. Note-se porém que o princípio do contratualismo remonta a Locke, no final do século XVII. ', '', 'Ciências Humanas', 3),
(132, 79, '<p>\r\n“Com efeito, até a destruição de Cartago, o povo e o\r\nSenado romano governavam a República em harmonia e\r\nsem paixão, e não havia entre os cidadãos luta por glória\r\nou dominação; o medo do inimigo mantinha a cidade no\r\ncumprimento do dever. Mas, assim que o medo\r\ndesapareceu dos espíritos, introduziram-se os males pelos\r\nquais a prosperidade tem predileção, isto é, a libertinagem\r\ne o orgulho.”\r\n</p>\r\n\r\n<small>\r\n(SALÚSTIO. A conjuração de Catilina/A guerra de Jugurta.\r\nPetrópolis: Vozes, 1990. Adaptado.)\r\n</small>\r\n\r\n\r\n<p>\r\nO acontecimento histórico mencionado no texto de\r\nSalústio, datado de I a.C., manteve correspondência com\r\no processo de:\r\n</p>', '', 'Intermediária', ' demarcação de terras públicas.', ' imposição da escravidão por dívidas.', 'restrição da cidadania por parentesco.', ' restauração de instituições ancestrais.', ' expansão das fronteiras extrapeninsulares.', 'e', 'A expansão romana no Mediterrâneo, sobretudo após a vitória contra Cartago nas Guerras Púnicas (264-146 a.C.), alterou profundamente a estrutura econômica e social de Roma, agravando os conflitos internos e gerando a crise da República, com o consequente advento do Império.', '', 'Ciências Humanas', 3),
(133, 81, '<p>\r\nOs seringueiros amazônicos eram invisíveis no cenário\r\nnacional nos anos 1970. Começaram a se articular como\r\num movimento agrário no início dos anos 1980, e na\r\ndécada seguinte conseguiram reconhecimento nacional,\r\nobtendo a implantação das primeiras reservas extrativas\r\napós o assassinato de Chico Mendes. Assim, em vinte\r\nanos, os camponeses da floresta passaram da invisi -\r\nbilidade à posição de paradigma de desenvolvimento\r\nsustentável com participação popular. \r\n</p>\r\n\r\n<small>\r\nALMEIDA, M. W. B. Direitos à floresta e ambientalismo:\r\nseringueiros e suas lutas. Revista Brasileira de\r\nCiências Sociais, n. 55. 2004\r\n</small>\r\n\r\n\r\n<p>\r\nDe acordo com o texto, a visibilidade dos seringueiros\r\namazônicos foi estabelecida pela relação entre: \r\n</p>', '', 'Intermediária', 'crescimento econômico e migração de trabalhadores. ', 'produção de borracha e escassez de recursos naturais. ', 'reivindicação de terra e preservação de mata nativa. ', 'incentivo governamental e conservação de territórios. ', 'modernização de plantio e comércio de látex. ', 'e', 'Esta questão refere-se à visibilidade dos seringueiros a partir da década de 1980. Segundo o texto da questão, no início da década de 1970, eles eram invisíveis no cenário nacional, ou seja, não tinham representatividade. Na década seguinte, começam a se articular num movimento agrário de camponeses cujo modo de vida se opunha à devastação da floresta por madeireiros. No caso dos seringueiros, a luta pela terra significava também a preservação da floresta, pois eles dependiam da seringueira, árvore nativa, e a extração do látex não requer a derrubada da planta. Ao contrário, o modo de vida dos seringueiros significava a preservação da floresta. Assim, na década de 1980, quando a questão ambiental estava em voga no mundo e quando surge o conceito de desenvolvimento sustentável, com a elaboração do Relatório Brundtland, a luta dos seringueiros por terra, mantendo a floresta, e o assassinato de Chico Mendes em 1988, fizeram com que ganhassem visibilidade no cenário nacional e internacional. Os seringueiros viraram um símbolo da conservação da floresta, e passam mais tarde a se juntar à luta por território de povos tradicionais em direção a um desenvolvimento sustentável. Na década de 1990, surge na legislação uma nova forma de Unidade de Conservação, as RESEX (Reservas Extrativistas de Uso Sustentável), que ajudavam a conservar a floresta e a manter o modo de vida dos seringueiros. A resposta da questão é a alternativa c. Observação: cabe ressaltar que o termo “preservação” da alternativa c não tem o mesmo sentido que possui no Sistema Nacional de Unidades de Conservação, uma lei sancionada no ano 2000. Nessa lei, há uma distinção entre os conceitos de preservação e de conservação de vegetações, sendo que o termo conservação significa que há proteção da vegetação, mas pode ocorrer o uso sustentável de recursos, enquanto o termo preservação refere-se a Unidades de Conservação em que não é permitida a ocupação humana. ', '', 'Ciências Humanas', 3),
(134, 82, '<p>\r\n“Porque todos confessamos não se poder viver sem\r\nalguns escravos, que busquem a lenha e a água, e façam\r\ncada dia o pão que se come, e outros serviços que não são\r\npossíveis poderem-se fazer pelos Irmãos Jesuítas,\r\nmáxime sendo tão poucos, que seria necessário deixar as\r\nconfissões e tudo mais. Parece-me que a Companhia de\r\nJesus deve ter e adquirir escravos, justamente, por meios\r\nque as Constituições permitem, quando puder para nossos\r\ncolégios e casas de meninos.”\r\n</p>\r\n\r\n<small>\r\n(LEITE. S. História da Companhia de Jesus no Brasil.\r\nRio de Janeiro: Civilização Brasileira, 1938. Adaptado.)\r\n</small>\r\n\r\n\r\n<p>\r\nO texto explicita premissas da expansão ultramarina\r\nportuguesa ao buscar justificar a: \r\n</p>', '', 'Intermediária', 'propagação do ideário cristão.', 'valorização do trabalho braçal.', 'adoção do cativeiro na Colônia.', 'adesão ao ascetismo contemplativo.', 'alfabetização dos indígenas nas Missões.', 'c', 'Embora a utilização do trabalho escravo tenha constituído a base da economia colonial no Brasil, o trecho transcrito aborda um aspecto menor da escravidão, qual seja a utilização de cativos em trabalhos de pequena monta.', '', 'Ciências Humanas', 3),
(135, 83, '<p>\r\nAs cidades de Puebla, no México, e Legazpi, nas\r\nFilipinas, não têm quase nada em comum. Estão muito\r\nlonge uma da outra e são habitadas por povos muito\r\ndiferentes. O que as une é um trágico detalhe de sua\r\ngeografia. Elas foram erguidas na vizinhança de alguns\r\ndos vulcões mais perigosos do mundo: o mexicano\r\nPopocatepétl e o filipino Mayon. Seus habitantes\r\nprecisam estar prontos para correr a qualquer hora. Eles\r\nfazem parte dos 550 milhões de indivíduos que moram\r\nem zonas de risco vulcânico no mundo. Ao contrário do\r\nque seria sensato, continuam ali, indiferentes ao perigo\r\nque os espreita. \r\n</p>\r\n\r\n<small>\r\nANGELO, C. Disponível em: http//super.abril.com.br.\r\nAcesso em: 24 out. 2015 (adaptado).\r\n</small>\r\n\r\n\r\n<p>\r\nA característica física que justifica a fixação do homem\r\nnos locais apresentados no texto é a ocorrência de: \r\n</p>', '', 'Fácil', 'solo fértil', 'encosta ingreme', 'vegetação diversificada.', ' drenagem eficiente', 'clima ameno.', 'a', 'Os solos próximos a vulcões são muitos férteis por possuírem substâncias como potássio, sódio e enxofre, que são trazidas para a superfície terrestre e servem de adubo para o cultivo, sendo assim um atrativo para a ocupação humana. Nessas áreas, o relevo é modificado, tornando o terreno mais íngreme e, consequentemente, dificultando sua ocupação. Além disso, a vegetação é dizimada pela lava que é expelida e a drenagem acaba sendo limitada pela declividade do terreno. ', '', 'Ciências Humanas', 3),
(136, 84, '<p>\r\n“Ao abrigo do teto, sua jornada de fé começava na sala\r\nde jantar. Na pequena célula cristã, dividia-se a refeição\r\ne durante elas os crentes conversavam, rezavam e liam\r\ncartas de correligionários residentes em locais diferentes\r\ndo Império Romano (século II da Era Cristã). Esse\r\nambiente garantia peculiar apoio emocional às\r\nexperiências intensamente individuais que abrigava\r\n</p>\r\n\r\n<small>\r\n(SENNET, R. Carne e Pedra. Rio de Janeiro: Record. 2008.)\r\n</small>\r\n\r\n\r\n<p>\r\nUm motivo que explica a ambientação da prática descrita\r\nno texto encontra-se no(a):\r\n</p>', '', 'Intermediária', 'regra judaica, que pregava a superioridade espiritual dos cultos das sinagogas.', 'moralismo da legislação, que dificultava as reuniões abertas da juventude livre.', 'adesão do patriciado, que subvertia o conceito original dos valores estrangeiros.', 'decisão política, que censurava as manifestações públicas da doutrina dissidente.', 'violência senhorial, que impunha a desestruturação forçada das famílias escravas.', 'd', 'O cristianismo, desde suas origens, passou a enfrentar perseguição do governo romano. A partir do século II d.C., a oposição romana se tornou uma política oficial, já que os seguidores de Cristo não cultuavam o imperador. Daí a necessidade de um culto às escondidas que se fortalecia em comunidade por meio de cartas, com destaque para as Epístolas de Paulo.', '', 'Ciências Humanas', 3),
(137, 85, '<p>\r\nA colisão entre uma placa continental e uma oceânica\r\nprovocará a subducção desta última sob a placa\r\ncontinental, que, a exemplo dos arcos e ilhas, produzirá\r\num arco magmático na borda do continente, composto por\r\nrochas vulcânicas acompanhado de deformações e\r\nmetamorfismo tanto de rochas preexistentes como de\r\nparte das rochas formadas no processo.\r\n</p>\r\n\r\n<small>\r\nTEIXEIRA, W. et al. (Org.). Decifrando a Terra.\r\nSão Paulo: Oficina de Textos. 2000\r\n</small>\r\n\r\n\r\n<p>\r\nQual feição fisiográfica é gerada pelo processo tectônico\r\napresentado?\r\n</p>', '', 'Intermediária', ' Planícies abissais.', ' Planaltos cristalinos.', 'Depressões absolutas.', 'Bacias sedimentares.', 'Dobramentos modernos.', 'e', 'O movimento convergente de placas litosféricas origina os chamados dobramentos modernos, a exemplo da Cordilheira dos Andes. Nesse caso, a placa oceânica, que é mais densa, mergulha sob a continental e entra em processo de fusão, dando origem ao vulcanismo e, consequentemente, à cadeia montanhosa. Por outro lado, planícies abissais são formadas pela divergência das placas tectônicas, enquanto bacias sedimentares e depressões absolutas são áreas rebaixadas. Já os planaltos cristalinos são marcados por sua origem antiga, apresentando assim menores altitudes. ', '', 'Ciências Humanas', 3),
(138, 86, '<p>\r\nA demanda mundial para a produção de alimentos\r\naumenta progressivamente a taxas muito altas.\r\nAtualmente, na maioria dos países, continentes e regiões,\r\na água consumida na agricultura é de cerca de 70% da\r\ndisponibilidade total.\r\n\r\n</p>\r\n\r\n<small>\r\nTUNDISI, J. G. Recursos hídricos no futuro: problemas e soluções.\r\nEstudos Avançados, n. 63, 2008 (adaptado)\r\n</small>\r\n\r\n\r\n<p>\r\nPara que haja a redução da pressão sobre o recurso natural\r\nmencionado, a expansão da agricultura demanda\r\nmelhorias no(a)\r\n</p>', '', 'Intermediária', ' fertilização química do solo.', 'escoamento hídrico do terreno.', ' manutenção de poços artesianos.', 'eficiência das técnicas de irrigação.', 'velocidade das máquinas colheitadeiras.', 'd', 'Para que haja a redução da pressão sobre a água, a expansão da agricultura demanda melhorias na eficiência das técnicas de irrigação. O uso eficiente pode ser alcançado atuando-se na estrutura de irrigação então existente, em sistemas de irrigação e gestão do uso de água, nos métodos de manejo da irrigação e nas técnicas que permitem aumento da eficiência do uso da água.', '', 'Ciências Humanas', 3),
(139, 86, '<p>\r\nNo caso do Departamento de Defesa dos Estados\r\nUnidos, a ênfase está posta no traçado de uma estratégia\r\ngeral de desarticulação, não só dos inimigos reais como\r\ndos potenciais, inserida na concepção preventiva que\r\nsupôe que a mínima dissidência é um sinal de perigo e de\r\nguerra futura. Deve-se ter capacidade para responder a\r\numa guerra convencional tanto quanto para enfrentar um\r\ninimigo difuso, atentando simultaneamente para todas as\r\náreas geográficas do planeta. Trata-se, sem dúvida, da\r\nestratégia com pretensões mais abrangentes que se\r\ndesenvolveu até agora.\r\n</p>\r\n\r\n<small>\r\nCECEÑA, A. E. Hegemonias e emancipações no século XXI.\r\nBuenos Aires: Clacso, 2005 (adaptado).\r\n</small>\r\n\r\n\r\n<p>\r\nTomando o texto como parâmetro, qual tendência\r\ncontemporânea impulsiona a formulação de estratégias\r\nmais abrangentes por parte do Estado americano?\r\n</p>', '', 'Intermediária', 'Erradicação dos conflitos em territórios.', 'Propagação de organizações em redes.', 'Eliminação das diferenças regionais.', 'Ampliação de modelo democrático.', ' Projeção da diplomacia mundial.', 'b', 'A tendência contemporânea que impulsiona a formulação de estratégias estadunidenses mais abrangentes, num contexto no qual não existem apenas inimigos reais, mas potenciais, e a propagação de organizações em redes, podem assegurar maior controle do espaço global, e manter a disseminação de suas ideias e valores, além de consolidar um ambiente sobre o qual Washington é um grande protagonista.', '', 'Ciências Humanas', 3),
(140, 88, '<p>\r\nO planejamento deixou de controlar o crescimento\r\nurbano e passou a encorajá-lo por todos os meios\r\npossíveis e imagináveis. Cidades, a nova mensagem soou\r\nem alto e bom som, eram máquinas de produzir riquezas:\r\no primeiro e principal objetivo do planejamento devia ser\r\no de azeitar a máquina.\r\n</p>\r\n\r\n<small>\r\nHALL, P. Cidades do amanhã: uma história intelectual do\r\nplanejamento e do projeto urbanos no século XX.\r\nSão Paulo: Perspectiva. 2016 (adaptado).\r\n</small>\r\n\r\n\r\n<p>\r\nO modelo de planejamento urbano problematizado no\r\ntexto é marcado pelo(a)\r\n</p>', '', 'Intermediária', ' primazia da gestão popular.', 'uso de práticas sustentáveis.', 'construção do bem-estar social.', ' soberania do poder governamental. ', ' ampliação da participação empresarial.', 'e', 'A cidade apresenta, entre outras características, elevada concentração de infraestruturas e serviços voltados ao atendimento de interesses sociais e econômicos. O planejamento, considerado como um instrumento que busca organizar a produção, a estruturação e a apropriação do espaço urbano, tem por objetivo desenvolver programas e serviços que visam a melhorar a qualidade de vida da população. Para atender as demandas de natureza econômica, o atual modelo de planejamento urbano tem sido marcado pela ampliação da participação empresarial, de modo beneficiar predominantemente os interesses voltados à reprodução do capital, sobrepondo-se em grande parte às medidas que visam atender as necessidades sociais.', '', 'Ciências Humanas', 3),
(141, 89, '<p>\r\nEscudos antigos ou maciços cristalinos são blocos\r\nimensos de rochas antigas. Estes escudos são constituídos\r\npor rochas cristalinas (magmático-plutônicas), formadas\r\nem eras pré-cambrianas, ou por rochas metamórficas\r\n(material sedimentar) do Paleozoico. São resistentes,\r\nestáveis, porém bastante desgastadas. Correspondem a\r\n36% da área territorial e dividem-se em duas grandes\r\nporções: o Escudo das Guianas (norte da Planície\r\nAmazônica) e o Escudo Brasileiro (porção centro-oriental\r\nbrasileira).\r\n</p>\r\n\r\n<small>\r\nDisponível em: http://ambientes.ambientebrasil.com.br.\r\nAcesso em: 25 jun. 2015.\r\n</small>\r\n\r\n\r\n<p>\r\nAs estruturas geológicas indicadas no texto são\r\nimportantes economicamente para o Brasil por\r\nconcentrarem\r\n</p>', '', 'Intermediária', ' fontes de águas termais', 'afloramentos de sal-gema.', ' jazidas de minerais metálicos.', 'depósitos de calcário agrícola.', 'reservas de combustível fóssil.', 'c', 'As concentrações de minerais metálicos ocorrem em rochas metamórficas em função das pressões e mudanças de temperatura e do próprio decaimento atômico. Essas rochas metamórficas, que correspondem a 4% do total de 36% de rochas cristalinas, surgem em vários pontos do território brasileiro, em estados como Minas Gerais (no Quadrilátero Ferrífero) e Pará (na Serra dos Carajás), por exemplo.', '', 'Ciências Humanas', 3),
(142, 90, '<p>\r\nEm A morte de Ivan IIitch, Tolstoi descreve com detalhes\r\nrepulsivos o terror de encarar a morte iminente. llitch\r\nadoece depois de um pequeno acidente e logo\r\ncompreende que se encaminhá para o fim de modo\r\nimpossível de parar. “Nas profundezas de seu coração,\r\nele sabia estar morrendo, mas em vez de se acostumar\r\ncom a ideia, simplesmente não o fazia e não conseguia\r\ncompreendê-la”.\r\n</p>\r\n\r\n<small>\r\nKAZEZ, J. O peso das coisas: filosofia para o bem-viver.\r\nRio de Janeiro: Tinta Negra, 2004.\r\n</small>\r\n\r\n\r\n<p>\r\nO texto descreve a experiência do personagem de Tolstoi\r\ndiante de um aspecto incontornável de nossas vidas. Esse\r\naspecto foi um tema central na tradição filosófica\r\n</p>', '', 'Intermediária', 'marxista, no contexto do materialismo histórico.', 'logicista, no propósito de entendimento dos fatos.', 'utilitarista, no sentido da racionalidade das ações.', 'pós-modernista, na discussão da fluidez das relações.', 'existencialista, na questão do reconhecimento de si.', 'e', 'O texto revela temas sobre os dilemas humanos (o inconformismo, a dúvida), de forma a recuperá-los em meio à construção do existencialismo filosófico, aproximado a reflexão no entendimento de si.', '', 'Ciências Humanas', 3);

